INSERT [dbo].[Coordinator] ([Id], [Name], [Phone], [Email], [U3AId]) VALUES (N'7e29f82a-8c48-49d7-900f-93c244a67f6d', N'Mike Lachlan', N'0413232111', N'michael.lachlan9@tafensw.net.au', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[Coordinator] ([Id], [Name], [Phone], [Email], [U3AId]) VALUES (N'9fa90dac-d90f-48a8-a7d6-ec1c837a121d', N'Sebastian Kotyla', N'Y0 Muma', N'cool@yo.com', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
SET IDENTITY_INSERT [dbo].[CourseDescription] ON 

INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8b007e15-7f0d-4c63-8ee3-0031ef68be4d', 1000, N'THE LONG ROAD TO FREEDOM   ', N'Three former refugees discuss with Patricia the traumas that caused them to leave their homeland and their settlement in Australia.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2edcd867-05e5-4dd6-a97d-0295be2412b1', 1001, N'TRAVELLING LADIES', N'Not all Victorian and Edwardian lady travellers journeyed alone. Retrace the footsteps of some famous couples such as the Burtons and Stevensons in the Middle East and Pacific Islands. Be inspired by the exploits of others travelling in Arabia and China. A course for the adventurous.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'210e0ea5-3e37-4d8f-97f8-03d161144f5c', 1002, N'TWO 2-DAY PICASA WORKSHOPS', N'Intermediate course about using Picasa - Google''s free software for storing, cataloguing and simple-editing digital photos. Less detail than the 5-day Digital Photo course, but more than we cover in our ''Computer Basics'' classes. Bring your camera with photos and its transfer cable.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'58d0d3c6-09b1-4289-9ea3-0557b2751118', 1003, N'HISTORY OF THE ANCIENT WORLD ', N'Each session comprises two or three 30-minute DVD lectures given by History Professor Greg Aldrete of the University of Wisconsin, followed by a brief discussion of the content of each by the group. The lectures cover the earliest period of known global civilisations of Mesopotamia, Egypt, India and China, eventually ending in 1000AD. There are elements of cross culture comparisons.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'91ebee12-90fb-494c-b37a-06717235d6c5', 1004, N'ARMCHAIR TRAVELLERS', N'Come and share travel stories and life experiences.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'efd45c00-abf9-47aa-ac9d-0746c7652fc1', 1005, N'ASPECTS OF AUSTRALIAN HISTORY', N'A potpourri of Australian history presented by some class members and occasional guest speakers.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a7c46eac-132f-4453-b241-0755c364d228', 1006, N'TAI CHI', N'This class is for Tai Chi novices as well as for more experienced practitioners. The aim is for all participants to progress from six to twenty four Tai Chi forms. (20 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'83a2c6db-c074-4ec4-b8cb-07ad48d090e4', 1007, N'JOSEPH HAWDON, THE FIRST OVERLANDER', N'This session will look at Joseph Hawdon, the first man to overland cattle from Sydney to Port Phillip and others who followed him.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c0edd729-fae4-476d-a415-0824019b1d22', 1008, N'AUSTRALIA IN THE GLOBAL ECONOMY 1788 - 2025 ', N'Beginning with Port Jackson’s Eora people before 1788, we travel through the early history of convict settlement, to the wool economy, followed by the building of modern Australian economy from 1861. We conclude with a look at the threats and opportunities out to 2025. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'816b8042-42b5-4bb1-a0df-082ef2742cd5', 1009, N'FRENCH CONVERSATION', N'A small group talks in French about varied topics, film, theatre, politics and general interest topics. Also a small grammatical exercise each session. Meet in Cutler Library. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'592bc218-4f48-43a2-80b6-08e0a898dcba', 1010, N'DISCUSSION GROUP - TOPICAL ISSUES', N'Enjoy stimulating discussion on a range of local and global issues. These can include interesting social, political, economic or environmental issues and ideas.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'15d4bfd9-8127-447b-9ac5-0d3a62da1159', 1011, N'THE GOLDEN YEARS OF POSTER ART', N'The series presents exemplary poster art of the last two centuries. Starting with the French period of Toulouse Lautrec, we continue through Art Nouveau and Art Deco periods in Europe and the Jazz Age in USA. We conclude with posters from countries as diverse as Japan and Australia.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f4436e34-4ed5-4a2c-a4ac-0d55980055d2', 1012, N'GERMAN INTERMEDIATE ', N'For all details, please phone leader.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'fbc98d44-d89d-4187-9618-0da64397bd42', 1013, N'GEMS OF THE SILVER SCREEN', N'Films: current, forties and fifties periods, all in DVD format, will be supplied and shown by Brian Harvey from his collection. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f24bb7c0-0e12-46c9-b8a3-0dacd1c2d773', 1014, N'DISCUSSION GROUP ', N'If you are interested in the world around us, combined with a love of the occasional debate, come and join us at Maroubra. We have fun.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'565278ba-691d-4709-884d-0e7a25299f93', 1015, N'A ROMP THROUGH THE HISTORY OF THEATRE', N'This is a course for those who like to explore the fascinating History of Theatre. Who influenced whom and why? How do classical works still resonate today? Sessions will include a presentation of the genre, lots of lively discussion and reading of examples. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'43ba9d93-7a8a-4aff-943d-0ebcb3ba6044', 1016, N'CREATING YOUR WEBSITE', N'Intermediate course for people experienced with Windows. Learn website creation and maintenance through hands-on creation of sample websites. You only need familiarity with word processing and file handling - this is not a ‘programming’ course. You’ll be given easily-used software tools to create web pages and prepare illustrations. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'90c5cc08-07f5-4307-b774-115ca97eb3b3', 1017, N'CRIME LITERATURE ', N'Emphasis is on top quality authors of both fiction and non-fiction books. All members have the opportunity to contribute their opinion during this enjoyable and relaxed gathering. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3d36d331-8f33-4a93-8a6b-11d82837a871', 1018, N'ISSUES FOR DISCUSSION', N'A participative group where all those present are encouraged to raise issues that may be of interest to them and to others. The topics are debated in a friendly atmosphere for the benefit of all attendees. Please come and enjoy the company of other U3A members. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'da87459f-25b4-416d-ab18-12620ffd3bc0', 1019, N'GERMAN INTERMEDIATE', N'This course assumes that students have studied German in the past and want to brush up on their speaking and reading skills and basic grammar. The emphasis is on oral German and some necessary grammar.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'add8e5d9-a027-4baa-a034-12f39ed16503', 1020, N'DIGITAL PHOTOGRAPHY - AN INTRODUCTION ', N'Intermediate course: learn how your camera works and manage, catalogue and edit your digital photographs using free software. Includes the basic principles of photography, how to store, transfer, display and share photos. Information on different digital camera types and useful internet resources. Bring your camera, transfer cable and Instruction Manual.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7c5d3ce6-064c-48d9-b583-1573bbfa6f8a', 1021, N'AUSTRALIAN POLITICAL AND SOCIAL HISTORY', N'The writing of Australian history is barely 65 years old. This leaves the study of 19th century Australia as fascinating, refreshing and a dynamic process. Welcome to what should be an interesting course. (Wesley Room)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd3265e8e-517a-42f0-8705-15cb38f1bf38', 1022, N'AFFAIRS OF INTEREST', N'Topics will include: The Floating Brothel, Black Death and other Historical Misfortunes, Greek Australian Milk Bar, Constance Emilie Kent and the Road Murder, Astronomy Snapshots, The Journey to Cardwell, The Channel Tunnel. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2d63e26f-cff2-4826-95d4-172f79e1ad83', 1023, N'DRAWING', N'Explore the art of drawing using various mediums - pencil, charcoal, pastel, pen and wash, water colour pencils.  Includes visits to art galleries. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cf0ce87d-c9e7-4c71-abff-1737d7691826', 1024, N'UKELELE FOR BEGINNERS ', N'No previous musical knowledge required, just a need to have a lot of fun with a friendly group of other beginners.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3ef91777-6bc8-401a-8980-187abdc69036', 1025, N'PATHWAYS TO THE GODS               ', N'This semester we will continue to explore the Classical Period of Ancient Greece, with emphasis on the arts, especially tragedy, philosophy, religion and the mysteries, and society. Visiting lecturers may be involved as well as visits to sacred sites. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'be291c18-589e-4ad9-8b0c-18ed1d54ded8', 1026, N'CEMETERY CELEBRITIES   ', N'Tales of intrigue, scandal and tragedy: Camperdown Cemetery has it all. Come and explore the history, architecture and beauty of this quiet resting place for the talented, the rich and the infamous alike. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'70e15605-c3bb-4d40-84fa-18f24794d36d', 1027, N'WRITING STORIES ', N'Everyone has at least one story in them just waiting to be found. Whether your stories come from life or your imagination, come and find them in our group. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd790867b-1cee-4bad-9d72-1b563bdeab09', 1028, N'BASIC MANDARIN FOR BEGINNERS', N'Basic Mandarin for beginners. Pinyin only. No experience needed.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ee0bf619-963f-4c12-9cee-1b86222b893f', 1029, N'PROPERLY PREPARING FOR SUCCESSION ', N'While the preparation of a proper will together with appointments of enduring attorney and guardianship is vital, a full understanding of the succession procedure will be highlighted. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6dcf81da-12cd-4385-a8d6-1c4a66ad34fa', 1030, N'WAM: WEDNESDAY AFTERNOON MOVIES', N'Remember the magnificent movies made since the 70s? I have selected some of the best from my collection for your enjoyment. Come and mingle with your friends in the half-hour before the movie starts and in the intermission over quality coffee and biscuits. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f2e93c74-6259-4ce2-bf73-1d106031743a', 1031, N'THE MIND, CONSCIOUSNESS AND OUR IMAGINATIVE BODIES ', N'We can identify mind process by the ideas that it causes to emerge.  Thoughts can be interrogated by other thoughts. Some thoughts are rigid (e.g. logical deduction and mechanics); some follow strict rules (eg. the laws of thermodynamics); and others are poetic, whimsical, philosophical and theological. The mind endlessly devises strategies to make meaning, while creating new, imaginative possibilities', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'977e141e-71e6-4fed-a4f6-1dda6c363ea4', 1032, N'PLAY READING ', N'Group reading of plays in a relaxed manner, no previous experience is necessary. Copies of plays will be provided.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'47699ab2-cf85-4af4-a4a5-1ddfc27e5c42', 1033, N'CLASSIC MOVIES', N'Classic movies - from the silent to the contemporary era. A selection of the very best and most influential films that helped develop the industry is presented. Analysis, background and historical settings plus production issues and biographical details pertaining to the director, cast and production personnel are explored.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8e8bfb83-bd7b-452a-95d1-1eec05d55627', 1034, N'DISCUSSION GROUP ', N'Topical issues and ideas discussed in a friendly and lively atmosphere. Join us to continue learning and communicating with an active group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b7d00f01-d41c-4fe2-a75b-1f1e30045f47', 1035, N'THREE JAZZ GREATS ', N'In each presentation, short excerpts from the recordings by the artist in question will be played. During morning tea, piano arrangements of songs associated with the performer will be included.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'64be4ce9-99e3-4361-9e22-1f73f9a9c835', 1036, N'FROM THE ROMAN EMPIRE   ', N'1. Julius Caesar - Hero or Villain?Let us decide whether Julius Caesar was really a villain or hero by looking at his life and some of his achievements and failures. 2. Roman Wives and Slaves through the Letters of Cicero, Pliny and Seneca. By looking at the actual Latin letters written by Cicero, Pliny and Seneca, we will learn what they reveal on this subject. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a150b69d-1a15-49e5-ad0f-1ff55b18c303', 1037, N'CLASSICAL BOOK CLUB ', N'Members take turns reading from prescribed text, often different translations, interspersed with lively commentary. After the completion of The Canterbury Tales by Chaucer, the Histories of Herodotus will commence in this semester', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'55c6176f-5ec6-4719-bfaf-205e2064c30f', 1038, N'IDEAS THAT CHANGED THE 20TH CENTURY ', N'The 20th Century was a social and economic tipping point in the history of humankind, which was driven by ideas good (Ghandi’s Non Violence) and bad (Hitler’s Nazism). We examine these ideas, those who created the ideas, those who picked up the ideas and brought them into the real world and the consequences of their actions, both immediate and ongoing.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8888d8c5-030c-4aea-aea4-2142eb9576cf', 1039, N'ADVANCED FRENCH', N'One hour of grammar and dictation and one hour of French civilisation', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f26eb13d-c898-4e42-bc16-22cc4de69be3', 1040, N'DISCUSSION GROUP ', N'Do you like to think about and discuss some of the interesting and confronting questions of our times? We encourage participation and enjoy stimulating exchanges of opinion. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e386bcf1-511a-454e-b165-238dd080ee9f', 1041, N'GERMAN ADVANCED', N'Previous knowledge of German essential.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7429a327-804c-42ee-bfd5-23ab5265da0c', 1042, N'ITALIAN INTERMEDIATE', N'For people with some Italian wishing to read, write, speak conversational Italian, greet people, introduce themselves, order food, buy train and theatre tickets, book accommodation, ask directions, learn some grammar, translate passages, write letters, learn about Italian culture and customs, cities and geography. Course book is Italian Berlitz Intermediate (Audiobook) + (Audio CD).', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd575225a-adf2-4673-93d2-243a822b7f57', 1043, N'WINDOWS PROBLEM-SOLVING WORKSHOPS', N'These two mixed beginners and intermediate workshops will be structured to answer your specific queries about operating Windows 7 or XP. When you enrol, you will need to tell us what you want you know so we can schedule the use of our class computers and have the right tutors present. If you have a laptop, you can bring it. You can attend one class, or however many you need.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a31ba3eb-69f0-4a5c-940c-25d2e3d3d34f', 1044, N'ADVANCED JAPANESE', N'This is a class for people who have an elementary knowledge of Japanese. It covers reading, writing and speaking the language in a small friendly group. New members welcome.     ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3e1e0139-92b8-4a7b-9e81-26ed4f343a98', 1045, N'SEASCAPES ', N'Over five centuries the lure of the sea has inspired many composers. We will play, discuss and compare some of their ‘seascape’ works eg. Bax, Bernstein, Bridge, Britton, Debussy, Glazunov, Ibert, Mendelssohn, Rimsky-Korsakov, Tchaikovsky, Vivaldi, Wagner, Zhou-Long etc. Please bring sea-sickness pills. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'190a9496-6ffe-448b-89ea-277461861a32', 1046, N'THE iPAD TRAVELLER', N'This presentation demonstrates how to explore the globe with an iPad and Google Earth. Travel the world in 3D, visit popular mysterious and forbidden places, and enrich your ‘travels’ with your Wikipedia tour guide. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cbd567b1-2584-470a-89ee-27a5279bd668', 1047, N'TWO GREAT PAINTERS', N'Hieronymus Bosch (ca 1450-1516) and Pieter Bruegel, the Elder (ca 1525-1569) were among the most original and creative painters of their time. Bosch even inspired 20th Century surrealist painters.  Bruegel is said to be among the first landscape painters. Their works will be presented in the context of the history of their time. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'63a4e77e-8cf7-4962-9a85-281de2832fb5', 1048, N'ROSE BAY - BOOK GROUP', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd9d57aca-3b2f-4565-9af6-28707b0326e9', 1049, N'SCENES ON THE SILK ROAD   ', N'New material visiting the amazing Mogao Caves, Tibet, the Uighur, Sufies, the Mongols and Venice.  Seeing the Silk Road through different eyes. (6 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'61cc8246-77ba-4fba-8a4d-28bec3df5c2e', 1050, N'INVESTMENT DISCUSSION GROUP      ', N'Our course aims to understand the forces and current events that affect investment markets. To do this we shall examine specific topics and undertake some practical activity. This is a Discussion Group only, and our members are not permitted, by law, to provide financial advice. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'13bc9624-41ca-4aad-8d73-29acc824529b', 1051, N'FESTIVAL PASSIONS ', N'All around the world classical music is alive and flourishing as never before at festivals large and small. From the famous London Proms to village churches and alpine sum­mer resorts we look at the venues, and listen to the performers and their music.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b11aa068-28b7-4fbf-a4c6-29c98540de32', 1052, N'SCIENCE AND TECHNOLOGY:', N'A new group will discuss science and technology and their effect on modern life, a mix of different speakers, using film and with informal talks. Interesting topics: no loss of continuity if you miss sessions.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'80c485ce-5eed-422d-949a-29e96afffb3b', 1053, N'GERMAN DISCUSSION GROUP ', N'Participants choose topics. Reasonable command of German required.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a4f617c4-02a0-44a5-9e42-2acaa58ea919', 1054, N'DESK-TOP FLYING FOR SENIORS ', N'With minimal cost you can install a flight simulator in your home computer and soon learn to fly and navigate from airports all around the world, enjoy the scenery and fly all types of aircraft from the Wright Flyer to a 747.  Venue close to Carlingford Railway Station or bus to Carlingford Court.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'59481ae6-8a82-4241-8514-2d444ae39999', 1055, N'BREAKFAST AT BLENDS', N'This group is for any members who want to make new friends without stress. Come for a light-hearted discussion and friendship - and a good breakfast. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e92aa818-909a-43aa-9392-2d44b48be902', 1056, N'PSYCHOLOGY: PERSPECTIVES ON PERSONAL DEVELOPMENT ', N'What are the forces which shape our personality? Are we propelled by innate drives or do we acquire habits as part of the socialisation process? Is our behaviour a by-product of instincts directed at self-gratification or do we guide our actions seeking self-fulfilment? We examine these questions from psychoanalytic, social-learning and humanistic perspectives. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a1f2c0c5-9acd-425c-b76a-2dadd1837a1b', 1057, N'FASCINATING ANCIENT PERSIAN EMPIRES AND US', N'More on the amazing legacies of four grand dynasties, especially Alexander the Great and his successors. History through archaeology, faiths, trade and the Silk Road. Meeting Room. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f8ef2722-ddfa-4b1a-b081-2ea8b4313836', 1058, N'LET''S TALK ABOUT IT', N'Informal discussion about the activities and personalities of yesterday’s and today''s prominent people, including royalty; outstanding contributors to the world scene and people in the news for whatever reason.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'095b47d8-9f44-47b1-a463-2eab97f7978f', 1059, N'THE INDIAN ECONOMY: IS THE ELEPHANT STIRRING?     ', N'The East India Company and commerce to 1857; the British Raj 1858 to 1947 and the effects of partition; from 1948 to the present. The licence Raj and the impact of liberalisation from 1991.  BRIC economy? (4 sessions) ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'25d4e472-f219-4bd9-a184-2eec9b8d7af8', 1060, N'HISTORY OF THE SECOND WORLD WAR', N'A brief history of the Second World War which was an amalgamation of conflicts in both Europe and Asia; from the Japanese invasion of China in 1937 to the Japanese surrender in 1945.  It was the most destructive war in history. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a4361a59-fd5f-43db-8a98-2f2f523a647f', 1061, N'WORLD HISTORY AND DEVELOPMENTS', N'This is a discussion group. All members are entitled to participate by doing research on agreed topics and taking part in group discussions.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'590c90e6-320a-4375-8f72-2f55d3bc9f91', 1062, N'WATERCOLOUR PAINTING', N'A practical beginners’ course in the basic techniques of European watercolour painting. Numbers will necessarily be limited. Equipment will be provided on loan and consumables provided at a small charge ($2 per session) until students feel confident enough to buy their own materials.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7acf0128-8313-493b-aab6-2f8a82ea934f', 1063, N'ITALIAN', N'This course is conducted in Italian including some advanced grammar rules.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3ad8c536-aaa0-411f-be05-2fd14e7c5f3e', 1064, N'PHILOSOPHY ', N'In this course, members research and discuss philosophers and their ideas. Topics are chosen by the group, thus common interest is assured. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e5f9748f-4406-4641-b435-3064a0047806', 1065, N'BRIDGE FOR BEGINNERS ', N'If you have ever wondered what the game was about, here is your chance to find out. Enjoy the thrill of competing in a social setting and learn to play club duplicate bridge. Course includes notes and supervised play.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a007cb44-ead6-4055-8385-30bd433e8814', 1066, N'SELECTED TOPICS ', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0fdcccab-46c3-4ad7-be78-3111b09c8772', 1067, N'FRENCH CONVERSATION ', N'We discuss current affairs, articles of interest from magazines and journals, also topics previously agreed on. New members with a good knowledge of French are welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'35f387e6-15ed-432a-acb6-3116ae18c031', 1068, N'ENJOYING ART', N'Whether you are a beginner or a seasoned artist, this course offers the opportunity to learn and participate with a group of enthusiastic painters.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'012479c0-b02f-45e8-91d8-317c0086a504', 1069, N'TAI CHI', N'Learn the ancient art of Tai Chi and gain health benefits through its gentle exercises and relaxation, which are ideal for Third Agers. Tai Chi’s graceful, fluid movements combine three forms of exercise: strength, stretching and breathing. Participants should provide assurance from their GP that they are medically fit to undertake an exercise course. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'17fa4509-1151-4436-abf3-31a55ee90668', 1070, N'CHICK FLICKS: THE CHANGING ROLE OF WOMEN IN MOVIES AND TV', N'Women’s roles in movies have changed over the past six decades from sirens such as Rita Hayworth to feminist icons such as Thelma and Louise to today’s chick flicks such as Bridesmaids', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c3b76c1f-a389-4cd3-b6cf-32590ef39027', 1071, N'BASIC LATIN ', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c92666a3-9e6f-446a-924c-32637e4349e3', 1072, N'DISCOVERING ART', N'This class will discuss the different aspects of art from architecture to sculpture with topics such as art nouveau, Celtic art, surrealism, origami and abstract art. We will also look at your favourite artists. Visits to art galleries are a regular highlight.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'fbaf80b4-e873-4ee9-ac42-334329708534', 1073, N'EXTENDING OUR WRITING', N'We will experiment with a variety of writing activities that explore different genres, including poetry, short story, satire and humour, on different subjects taken both from life and from our imagination. We read our work aloud for discussion and feedback.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'94f7eee7-c011-4993-9291-334fc61aa76f', 1074, N'TOPICS OF OUR TIMES', N'Interactive discussion and debate on political, economic and social issues affecting Australia and the world. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'847f9f80-397d-46d7-86c7-34f41acac30a', 1075, N'I CAN SING, I CAN DANCE', N'A five year old can do anything. We think we can’t, but is that true?  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'18231aea-08b9-4d07-8c67-3574114dcb3b', 1076, N'BEGINNING YOUR MEMOIR ', N'Have you always wanted to write about your childhood or your family? Your life is unique. We will work step by step to make an interesting record for future generations. You do not have to be an experienced writer to enjoy this course.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b06e2e66-e6a2-478a-be91-35c89b4cfeeb', 1077, N'PORTRAYAL OF ABORIGINAL PEOPLE IN AUSTRALIAN FILMS  ', N'A look at how Aboriginal people and culture have been portrayed in Australian films over the years from Jedda to Ten Canoes. Each session will involve watching a film for discussion afterwards.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'67f0a74a-8285-463a-83be-36a4e7ffccee', 1078, N'‘A STAKE IN THE HEART’ LITERATURE’S VAMPIRES   ', N'The question at the heart of this subject is why literature’s vampires have stayed ‘alive’ for so long. Our focus will be Bram Stoker’s Dracula (1896) but numerous vampire narratives from Lord Byron’s Fragment (1819) to Stephanie Meyer’s Twilight (2005) will be introduced. (6 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'38ee0aa8-15ec-42ec-b9fe-382389ec0413', 1079, N'AN INTRODUCTION TO GREEK AND ROMAN MYTHOLOGY ', N'This course will introduce the gods, goddesses and heroes of Ancient Greece and Rome. Reference will be made to Homer’s Iliad and Odyssey, Virgil’s Aenid and Ovid’s Metamorphoses. These powerful tales will be illuminated by a study of their geographical setting and the evidence of archeology. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'923b8f2f-d371-4850-86c6-38401145c415', 1080, N'CINEMA DISCUSSION AND STUDY GROUP ', N'This popular group discusses two movies per session, that is, members see two group-selected feature films in each fortnight. Each film is presented by a member of the group (voluntary) in a 5 to 10 minute introduction. Discussion follows. Our group is warm, friendly and stimulating.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'015d7695-3ba6-441c-84e2-38c1d9ceda24', 1081, N'TWO GREAT CRICKETERS', N'The careers of Don Bradman and W.G. Grace. (2 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'05260820-24cb-4689-8255-38f8ed7b89b9', 1082, N'CREATIVE WRITING', N'An introduction to the fun of self-expression.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1e89f439-5edd-4550-a51e-3916b406593f', 1083, N'WHAT IF? SCIENCE FICTION - THE BENEFITS AND DEMERITS ', N'Science Fiction definitions: genres, authors, bookcovers and new technology from SF. Who should read SF and why?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0bf01b0d-3e46-40f2-99ea-39a690982168', 1084, N'SHAKESPEARIAN TRAGEDY', N'The development from Hamlet to Anthony and Cleopatra. (3 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3c154095-7f5e-44e9-9613-3ac1e015d8ba', 1085, N'SPANISH INTERMEDIATE', N'An adequate knowledge of grammar, vocabulary and pronunciation is needed, as well as a sense of humour. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd8b963f0-d342-43dd-9e91-3b005f03bb73', 1086, N'GROWING YOUR FAMILY TREE', N'Interested in your family history? Join a friendly, helpful group all engaged in digging up their ancestors. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'716aa1d7-f362-47b9-86fc-3c29dcdeac91', 1087, N'FUN AND GAMES', N'A light-hearted course to stretch your mind, playing scrabble, canasta, rummikub and other games in a friendly atmosphere.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8a5a0292-3090-464c-95ad-3d5ee16b489d', 1088, N'JAPANESE FOR BEGINNERS ', N'Beginner''s Japanese - relaxed, friendly study of grammar, reading and writing.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4c6a6629-6f97-409f-ad15-3e178b80a4c0', 1089, N'DEMYSTIFYING STOCKS AND SHARES', N'This course is for beginners and includes presentations and discussions. The aim is to introduce participants to basic trading tools and techniques. This will enable people to understand and verify advice provided by financial advisors. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'40acb056-e453-47b5-bf4b-3e6e888bd980', 1090, N'DISCUSSION GROUP (Wahroonga) ', N'A friendly group focused on current affairs and general interest topics.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ca6fa5ac-f64b-49d6-92e5-410891c5c65f', 1091, N'THE GOLDEN AGE OF CINEMA ', N'We continue to unearth filmic gems from the Golden Age. Hollywood, London and a few other areas provide the source material. The period covered is to about 1950. All programmes are properly introduced and course notes for every session are provided. New members welcome. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'11cf5893-0858-481e-a5c4-423a3f4c258c', 1092, N'AUSTRALIA OUR LAND    ', N'Using books and videos from the library we study and discuss the environmental, geographical, historical and cultural aspects of our wonderful country.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6ad5becc-f339-4b7d-92df-42dd79755f9b', 1093, N'NOVELS AND BIOGRAPHIES FROM THE 19th CENTURY ONWARDS ', N'A literary discussion group studying 10-11 books each semester. The first book will be Skios by Michael Frayn, followed two weeks later with Our Mutual Friend by Charles Dickens. Enthusiastic readers most welcome. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b31b478f-c825-4d36-aec4-432a3bf534f8', 1094, N'HALF-DAY INTRODUCTION TO THE iPAD', N'Beginners course where you get to know your iPad in the company of others under the guidance of our tutor. You must bring your iPad. Apply in the same way as our other courses, as places are limited.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'592cae7e-8f42-45c0-93fc-434fc1b6a433', 1095, N'ISLAM IN THE MODERN WORLD', N'The Articles and Essentials of Faith. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'10b70bf6-aa44-4ffd-810f-438a6523d058', 1096, N'WALKING AROUND SYDNEY', N'A variety of walks around all areas of Sydney and surrounds ranging from medium level to easier bushwalks, track and street walks, going to beautiful and interesting places accessible on foot, whilst enjoying good company in the outdoors. Walking in many different parts of Sydney, we welcome members from all U3A regions to come and join us. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8fefec27-4562-41a2-95e0-43c904684059', 1097, N'MEDIEVALISM AND THE ENLIGHTENMENT    ', N'This course discusses feudalism in Europe followed by an overview of the medieval world, culminating in the Enlightenment - a fascinating several hundred years in European history. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'79171a15-b3a6-4c4b-a7ba-4418ac46415d', 1098, N'ISLAM IN THE MODERN WORLD', N'Islam in the modern world covers the general aspects of daily worship and highlights the very essences of Muslims in the contemporary world, e.g. women’s rights, jihad, terrorism, what it is and how it fits in the Islamic realm. Also covering Sufism and its principles. What is modernity? Can Muslims fit into modern life styles?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
GO
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'101057fd-15fd-4573-a118-442e894afa8e', 1099, N'GREAT SCREEN LOVERS', N'Take a trip down memory lane as we use multi-media sources to explore and discuss the often turbulent off and on screen lives, loves and movies of Elizabeth Taylor and Richard Burton.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd1ecbe19-3538-4a9e-8622-45d88131d0e2', 1100, N'EIGHT FABULOUS FRIDAYS', N'A series of separate presentations on subjects of general interest.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3910865f-67c4-46db-a356-45db3ceb682e', 1101, N'GARDENING - HARVESTING THE SUBURBS (Gymea Bay)', N'Group meets to share experiences (successes and failures). Topics include seed raising, transplanting, permaculture, organics, herbs, companion planting and pruning. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'81faadb1-a325-457a-b34a-45ec0b669d1f', 1102, N'PIES AND PICTURES ', N'Our friendly group meets over a lunch of individual beef or chicken pies specially ordered from a local bakery, followed by an outstanding movie on DVD. Please note the home theatre has limited capacity. Booking is essential.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ef4c1c0f-ec5f-4b1c-9096-45fbbc7bdf8a', 1103, N'A UNIVERSE OF STONE', N'A look in words, pictures and film at the original development and meaning of the unparalleled human achievement of the glories of Gothic cathedrals.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'155cdb6a-3ad5-4126-ba19-464ccec8e27f', 1104, N'FRENCH FOR NEAR-BEGINNERS', N'A course for those who have done a little school French only. We will study basic phrases through topics such as likes and dislikes, hotel booking, asking the way etc. Course focuses on conversation. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'beac3f3f-3736-44ba-8294-470cc083aa0e', 1105, N'A LIVELY DISCUSSION GROUP', N'Have your say.  I may not agree with what you say but I will defend your right to say it.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'976ed0f1-01fa-487f-8eb7-4736dff1e073', 1106, N'FOR THE LOVE OF MUSIC (Drummoyne)  ', N'This course is for lovers of classical music. In a relaxed and friendly atmosphere we learn about the life and times of various composers and listen to some of the wonderful music they left behind. Enjoy the experience with other music loving friends. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd555d5df-babe-476b-8d76-47d52f7f5559', 1107, N'AUSTRALIANA - APPLIED ARTS and FAMILY HISTORY LETTERS ', N'Many heritage decorative items with an Australian theme, especially from Federation times, such as shaped wood, glass, tiles, plaster, ceiling roses, post cards to door knobs have been found on visiting demolitions. These talks will provide an entertaining walk down memory lane for those interested in house restorations.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e3abb73f-4c28-4221-a765-47d7a0976cfe', 1108, N'BECAUSE IT’S THERE', N'A look at the life and achievements of George Mallory, illustrated by picture and film, before and on Mount Everest and whether he made it to the summit in 1924? ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3bee3bc1-1991-4e2d-ad7e-4837dd98e1ca', 1109, N'RICHARD STRAUSS           ', N'Hero’s Life conducted by Sir John Barbirolli   ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9d07b845-720b-40f3-99ef-484f1ec2ff7c', 1110, N'BALLET ON SCREEN', N'For beginners and all ballet lovers - The Australian Ballet’s Giselle; Les Ballets de Monte Carlo’s intense Cinderella; Moira Shearer and Robert Helpmann in the Oscar-winning The Red Shoes; and A Thousand Encores (The Ballets Russes in Australia) along with The Australian Ballet’s Les Sylphides, Petrouchka and Firebird. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'42c1aab3-913b-41ce-9632-48978b807843', 1111, N'AN OVERVIEW OF SCIENCE', N'A series of lectures and discussions on a wide range of scientific topics by guest speakers. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7aadfe69-b81e-4364-b03b-494f46703122', 1112, N'SIDNEY KIDMAN AND THE CATTLE INDUSTRY', N'Sidney Kidman was knighted for his work in expanding the cattle industry of northern Australia but was he a hero or a villain?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'958e5066-3b66-4a98-954e-498000e1e2bb', 1113, N'TUESDAY AT THE TRAMSHED', N'A series of separate presentations on subjects of general interest. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'386fe68e-fa85-4e9d-a1d8-498df22f9f22', 1114, N'LAWRENCE HARGRAVE - AVIATOR', N'Lawrence Hargrave was one of the greatest world aviation pioneers. The Wright Brothers and first European aviators built on his work.  Michael will illustrate this, using models of Hargrave’s inventions. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd1397eac-d208-4c37-909b-499ed4700346', 1115, N'MEDIA DISCUSSION GROUP', N'The group discusses the news of the day - topics decided by popular choice; everyone happily participates, even though consensus is rare. New members welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c9ebffee-12d5-4dab-be6a-49a09560f123', 1116, N'CANASTA FOR ALL', N'Canasta is a great social card game. This is an opportunity to learn the rules of the game, pick it up again if you have played before, or to polish up your playing skills in a friendly and supportive environment', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0c1c9f85-e4f1-4aca-af3a-4a12b9fc47fd', 1117, N'MAKE A JOYFUL SOUND ', N'Do you hum in the shower? Do you sing in the car? This could be just the course for you. Come along each Monday morning and learn and perform some beautiful music for choirs. It’s easy and it’s fun! ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f14f9ce8-8297-4040-a58d-4bce582d4af9', 1118, N'EXPLORING THE PAST (Merrylands West)', N'Video clips and discussion about various famous people and events of historic importance from the past.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ea1b94d2-6172-4b84-9a8b-4c66682f1937', 1119, N'ITALIAN', N'For students who have a reasonable knowledge of the Italian language who wish to improve their level', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4739faeb-b23e-416d-8486-4c7cce5e598a', 1120, N'INDOCHINA - CAMBODIA, LAOS, VIETNAM', N'Few countries have had such a colourful past as these: conquering kingdom, vicious civil wars, ignominy of colonialism, independence that led to the horrors of the Vietnam War and of Pol Pot and Co.  Vietnam, at least, is now doing well; Cambodia and Laos, less so.   What now? ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3e5e5b6d-77c4-4c11-9dd3-4d1e075c565f', 1121, N'ANYONE CAN PAINT (Pymble) ', N'It is time to try your hand again. In a very relaxed atmosphere, with as much, or as little, tuition as you wish, oils or acrylics.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'05e39c7a-3d97-460e-82ce-4dc5c00f87cc', 1122, N'SOCRATIC DIALOGUES   ', N'The course will centre on Plato’s method of philosophy as ‘dialogue’ - in particular, Republic, Books 7 and 10, on art, imitation and reality, and the Phaedrus and Symposium, on language and love. These works will be available from the course convenor.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'99786468-676c-4ea2-ad47-4dccc866736a', 1123, N'BRUSH UP YOUR CHESS (Carlingford)', N'For all those with the basic skills, have played, love chess, and enjoy challenging the mind with this game of pure skill and with the demand required to achieve checkmate, this group is the one for you.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2bc7458d-cfe6-4f8f-9372-4e7aa644f844', 1124, N'NORTHERN BEACHES COURSE SHOWCASE', N'Join us for morning tea and hear a number of short presentations by leaders of new courses and with other leaders also showcasing their courses for the new year.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b7d82aa0-32ef-4cac-b542-4fe428d4f3f3', 1125, N'NAPOLEON - HERO OR VILLAN?       ', N'Robin will examine the achievements and failures of this controversial figure who crept out of Corsica to become head of the army, First Consul and later Emperor of the French. His reforms in France, also adopted elsewhere, survive to this day. Yet millions in Europe lost family in the wars which convulsed Europe for almost 20 years. (5 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'71c08396-87e0-4e54-b58e-502559420ad8', 1126, N'FRIDAYS IN THE FOREST', N'A monthly series of separate presentations on issues of general interest given by speakers prominent in their field. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'49e0caaf-d22f-42ab-bd09-50754a52fe90', 1127, N'AFGHANISTAN - THE SURVIVOR ', N'Afghanistan has been invaded countless times - not for its territory but for its strategic location between the Middle East, Central Asia and India. It has survived all while inflicting damage on invaders. Now ''our'' escapade is ending - yet the Taliban and warlords remain. What have we learnt?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8efff96f-9a78-4b54-9720-513eda702faf', 1128, N'DISCUSSION GROUP', N'Our friendly group enjoys stimulating and serious discussion on current affairs and a variety of subjects.  There is controversy, reminiscing and usually lots of laughter.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b9bb1fc8-1fde-4723-95ac-51f739742294', 1129, N'FAMILY TREE MYSTERIES SOLVED', N'This is a support group for those addicted to researching their family history. Members range from beginners,', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f8396b25-0b0e-4a72-9af3-52213e1a8e52', 1130, N'A HISTORY OF THE PLANET EARTH       ', N'After the Big Bang, galaxies and stars were created. The Solar System, including the Planet Earth, was formed 4.5 billion years ago. The moon was captured. The first billion years was hectic. Life then began. Geological and biological evolution continued. Single then multi celled life evolved. Dinosaurs came and went. Earth became the planet for fish, insects, birds and humans. Come and hear this compressed 8 session story. A full set of notes will cost $15', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'dc4f0bca-c820-4109-8e60-52b9c50c5571', 1131, N'AUSTRALIAN COLONIAL DYNASTIES: MANSIONS, MARRIAGES AND MORES', N'Reflect on the private lives of the Macleay, Wentworth, Macarthur and later Swann families. We will explore their trials, tribulations and contributions to the emergent society of New South Wales.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5585a60f-5d71-45bd-99ee-5303dcd72531', 1132, N'THE O’FARRELL GOVERNMENT TWO YEARS ON        ', N'Neo-liberalism, public education and the health system, is it working?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0a9b80fa-6bac-49da-bb2c-533d58ff86fa', 1133, N'INTERMEDIATE JAPANESE ', N'For people who are able to read Hirigana.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b2e69f97-a3a0-4f0f-98bc-534a1e6c5ea7', 1134, N'PUTTING FUN INTO EVERYDAY THINKING', N'How we think limits what we think. ‘Thinking – Blocks’, assumptions and biases can affect everyone.  Activities in this entertaining and involving workshop will help identify limits in individual thinking and then apply techniques to overcome these limits. Heather Flawith Room. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'da5c72a8-1f19-421b-9981-53ceff9c94f6', 1135, N'AUSTRALIAN HISTORY SEMINARS', N'Historians and researchers discuss their work. Topics include: New research on Bennelong; Voting systems in Australia; History of Cruising; Goat Island; Captain Thunderbolt and his lady; Macquarie’s life before arriving in NSW; Greek Australians 1820s to present; A family researcher’s pursuit; Lady Juliana convicts.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ab462ecc-0384-4b75-82c5-53fc30d2d5fe', 1136, N'FOOD FOR THOUGHT', N'We meet to sample the cuisine of different nationalities. We aim to discover some of the cooking origins, locations and unique ingredients in our travels. Friendliness, fun and food as a basis for finding out about different cultures.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0a2f8206-aa0e-4e64-b8e0-54398b587429', 1137, N'AUSTRALIA’S PAST THROUGH PICTURES, BALLADS AND BROADSIDES', N'19th Century Australia dull? Not when viewed through the eyes of participants and observers. It was populated by rogues and heroes, opportunists and solid citizens, dreamers and doers and salt of the earth people (most of them women)! Let’s look at them in the context of their time and place. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ea75b75d-0d7a-4747-a9b1-544bbfddb05d', 1138, N'AUSTRALIAN HISTORY - THE ORIGINS OF AUSTRALIAN PLACE NAMES', N'What’s in a name?  We will talk about how Colonial Australian place names originated; such as - Sydney and Wee Jasper.  All welcome to participate.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a979fc4d-855f-45cc-8e41-54b29af813fa', 1139, N'INTRODUCTORY LATIN ', N'For those who have never studied Latin or whose memories of Latin are distant and hazy, this course starts with the foundations of Latin vocabulary, grammar and cultural background. You will be constantly surprised at how much Latin vocabulary we have in everyday speech. We are using the Oxford Latin Course Book 1. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f9458eab-66f8-4f38-9b51-54b526e5c263', 1140, N'ISSUES AND IDEAS ', N'In this lively, long-lived group, newcomers are very welcome. We research papers (on a voluntary basis) on a wide variety of contemporary issues. We then discuss one per session.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd16edeee-e46b-4f91-9180-5536ceee6786', 1141, N'GENEALOGY AND FAMILY HISTORY', N'This course is for those who wish to research their family history with a focus on Australasia, the United Kingdom and Continental Europe. Other countries may be included depending on class interest. Suitable for both novice and advanced historians. Basic computer and internet searching skills are assumed. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0c258a4a-85fb-4562-94ff-553b9e6c197e', 1142, N'UKRAINIAN HISTORY, CULTURE AND LANGUAGE (Wahroonga) ', N'This course will present an overview of Ukrainian history from ancient to modern times. Aspects of Ukrainian culture and traditions will also be presented. Participants will have the opportunity to learn some common phrases of communication as well as sampling traditional Ukrainian food.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3969aef4-f7e1-4da5-a368-55539aa811c9', 1143, N'TOPICAL ISSUES', N'Our friendly group discusses two topics each meeting. Come and discuss current affairs and debate social issues. New members are always welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b988ec2f-59ef-43e0-920e-583b8c6e4756', 1144, N'BOOK DISCUSSION GROUP (Pymble)', N'We meet each month to discuss both fiction and non-fiction. Our first book will be From the Holy Mountain by William Dalrymple.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'83c49b15-4bb7-4c95-b4cf-58ad410089f9', 1145, N'THE RISE AND FALL OF ANCIENT CIVILIZATIONS', N'In-depth study of ancient civilizations from early Egypt, surrounding Empires and Mediterranean states.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'aedad6d6-3544-4165-be6c-58c390557171', 1146, N'SIX SUPER SINGLE SESSIONS', N'A series of separate presentations on subjects of general interest.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f5c4fee4-e44c-46e9-9913-591d9a4a046b', 1147, N'RECORDER GROUP (Waitara) ', N'This is a group meeting regularly to enjoy playing music. New members need to be auditioned. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1634e73b-514f-439c-b0ea-59238e9a1386', 1148, N'FOOD FOR THOUGHT', N'We meet to sample the cuisine of different nationalities. We aim to discover some of the cooking origins, locations and unique ingredients in our travels. Friendliness, fun and food as a basis for finding out about different cultures.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e0270b57-b22d-4c6c-9d84-598eee2d253f', 1149, N'HISTORICAL AND OTHER INTERESTING TOPICS', N'This is a lecture series on a wide variety of topics given by people with expertise in, and enthusiasm for, their subject. The auditorium is well equipped for audio-visual presentations. Comments and questions are encouraged. Bookings not required. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'daef040b-0e0e-4017-b930-5a5393aeb198', 1150, N'THE REFORMATION AND THE RENAISSANCE', N'This semester we will talk about how these two movements completely changed Europe in the Middle Ages to present times.  We will look at all aspects, including discussing the influential people involved with these movements.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3211217d-7326-4ee1-913a-5befb02f5c44', 1151, N'PHILOSOPHY (Pymble) ', N'This year we continue Ancient Greek Philosophy by studying Plato’s famous pupil Aristotle. His wide field of interest has influenced centuries of philosophical and scientific thought and can still be felt today. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6f79b226-dd89-449b-9a15-5d00d4905d94', 1152, N'MEDIA RITUALS AND THE CULTURE OF CELEBRITY', N'Anthropological and sociological approaches to ritual as a meaning-making agent underpin this subject’s investigation into why more and more people of all ages and persuasions have come to see the media, and the celebrities it creates, as sources of moral and political authority. (6 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'41a7925b-c873-4ef0-8f75-5db8605de111', 1153, N'LOVE AND WAR', N'More new scholarship on relations between, and true life in ancient Greece, Rome and Persia.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'71366508-9d6e-4afc-8b67-5df842e930bc', 1154, N'DISCUSSION GROUP ', N'Covers current affairs and topics of general interest. There is plenty of room for discussion from everyone. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4467d797-d315-496a-9b93-5e1cf785b18a', 1155, N'FRENCH FOR BEGINNERS', N'A foreign language can be daunting, but, armed with everyday phrases, the visitor can be more confident having been given opportunities to speak, learn and practice and also, to attain a good French accent.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b30d790a-381c-49c2-8d31-5e42e2bbc0f3', 1156, N'CRYPTIC CROSSWORDS ', N'There will be three sessions. First, we give an introduction to cryptic crosswords with definitions and types of clue. The second session will involve the group working through two puzzles. Finally you will be introduced to the compiler’s job. The course will be led by a compiler from the SMH and is directed at beginners and improvers.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'da33c736-4e02-4fe1-96a5-5e4db6ef9ed3', 1157, N'AVIATION HISTORY (Carlingford)', N'Join a discussion group dealing with aspects of aviation history: Australia and world-wide.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c69e1a63-ed91-45c7-b01a-5e731eb80954', 1158, N'PLAY READING', N'This course is for lovers of theatre. You have the opportunity to read great plays. The leader has been involved in amateur theatre for thirty years. She loves to listen to the group give their interpretation of the characters. Why not come and join us? ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4b5a854c-d82e-4e81-9213-5f193545a0a9', 1159, N'AUSTRALIAN HISTORY DISCUSSION GROUP', N'Talks on any topic of Australian history.  Topics and talks chosen and given by group members who are prepared to do so.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'31d06e25-3bdb-4284-9224-60547d8311f6', 1160, N'THRILLERS AND MYSTERIES', N'Join a monthly book-reading group for those who read for entertainment and love ‘whodunits’.  We each take turns in selecting two authors for the following month.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'56eb68d0-d343-4fc5-8763-607580d16292', 1161, N'CINEMA GROUP              ', N'Group analysis and assessment of quality cinema, particularly ‘art house’ style. Each member is given the opportunity to rate two films each fortnight, with emphasis on production values, scripts, direction and acting, with group discussion to flesh out issues raised.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'068d40bc-07bd-46bd-ad94-6082ddfa0b22', 1162, N'BEETHOVEN’S VIOLIN CONCERTO', N'Played by Yehudi Menuhin. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'03b76784-6880-40ce-9313-60a27d6611ea', 1163, N'EXPLORATIONS IN MUSIC', N'A music appreciation course.  A listening experience covering various kinds of music from early classical, romantic, orchestral and choral through to jazz and synthesizer - exploring different countries, themes or individual composers from a range of different eras. Detailed handouts supplied. Come, enjoy and be challenged.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'337ffd9a-5693-435a-bef3-60e34b020ad3', 1164, N'FRENCH CONVERSATION', N'Lively discussion group debating topical subjects.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'51a31ca5-706b-47f1-af60-61550acc15b0', 1165, N'BACH TO THE FUTURE ', N'During this year we shall consider a range of aspects of classical music, covering all genres - from chamber to symphonic, from plainsong to grand opera, from medieval to modern. All talks will be illustrated by recordings from the great artists.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'62a80c0d-7262-4031-862c-616f54eb7d19', 1166, N'THE MISUNDERSTOOD MIDDLE AGES', N'A wide ranging and copiously illustrated look at the major achievements of the European Middle Ages, and how they underpin much of modernity. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1159ecdb-8513-4710-b1f8-6203017f1d58', 1167, N'SPANISH CONVERSATION', N'We are using Suenos: World Spanish 2 and also use other materials but essentially we speak in Spanish all the time. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7cf272ef-f411-4c67-a487-6219d220be54', 1168, N'CURRENT AFFAIRS DISCUSSION GROUP', N'We discuss current affairs and associated ideas based on media reports in an informal and objective manner. Subjects presented for discussion by a leader who is rostered on a voluntary basis in each session. New members are welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0c4200ee-93c3-49f8-bc9a-62784d969964', 1169, N'SOLO WHIST - A CARD GAME', N'Knowledge of Solo required for this friendly group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0a93c989-1b3d-4582-b477-631fba22ff4d', 1170, N'BUSH WALKS - WITH A TOUCH OF HISTORY   ', N'All walks medium grade. You are responsible for your own safety on the walks. Bring hat, water, lunch, block-out cream. Wear shoes with a safe walking tread. NOTE: Trains: We travel in the 3rd carriage. Timetables subject to change: Check Transport Info Line 131500. Call Leader for late program changes.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'fe1bcab2-5b79-497f-b04b-635262d03693', 1171, N'WALKING IN SYDNEY AND SURROUNDS', N'A variety of walks around all areas of Sydney and surrounds ranging from medium level to easier bushwalks, track and street walks, going to beautiful and interesting places accessible on foot, whilst enjoying good company in the outdoors. Walking in many different parts of Sydney, we welcome members from all U3A regions to come and join us. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'49d3b47e-ea39-4cdf-82fb-6353988c042d', 1172, N'FILM APPRECIATION', N'Do you enjoy contemporary cinema and sharing your ideas?  Members of this group research a film and lead the discussion three to four times a year. We also look at issues, trends and news in the film world. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'085872fa-8bae-4abd-b0f2-6436deaeb542', 1173, N'SO YOU THINK YOU CAN WRITE?', N'We will discuss the problems of being a writer in the 21st century.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c6a4f2bd-f428-48e7-b36b-6488c2254d8a', 1174, N'MY LIFE OF CRIME', N'The sharing of experiences of a senior female officer in the NSW Police Force. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cab58b68-73c0-48db-8e08-649a7455994d', 1175, N'FRENCH CONVERSATION', N'A small group participates in French conversation over a cup of tea.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'11c521e2-1591-4c0d-82f5-64a136edc253', 1176, N'PATHWAYS TO THE GODS', N'This semester we will continue to explore the classical period of ancient Greece, with emphasis on the arts, especially tragedy, philosophy, religion and the mysteries, and society. Visits to sacred sites and visiting lecturers may be included.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'69739bc0-85bf-408e-8906-64f7639e6146', 1177, N'THE WRITER''S VOICE', N'A comprehensive course in creative writing. It includes short stories, articles, life stories, poetry and novel writing. A talk is given by the facilitator, followed by a positive critique of members’ contributions. It is not compulsory to contribute. A supportive and friendly group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f5703bfc-f314-40aa-a3ee-66041684ddac', 1178, N'RHYME OR NOT TO RHYME', N'Every fortnight we invite you to Lane Cove to take part in our informal group to talk about poetry and prose. Shared creative ideas make for interesting discussion.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'65200406-9173-4aa1-946e-66c0a81b3b75', 1179, N'SPANISH BEGINNERS                 ', N'No experience required. Will cover the alphabet; focus on writing, speaking, listening and personal interactions. We will end up holding a conversation in Spanish.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'795c0bbd-05a1-4bad-9012-66e699e7f1d5', 1180, N'MUSIC AND OTHER JOYFUL NOISES (Carlingford)', N'Class members are invited to bring their own choice of music (tapes, CDs etc.) and perhaps talk about the reason for their choice, be it personal or about the composition or musician.  Any kind of music is welcome, including musical jokes.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7ddc9859-5c71-4348-bb85-673383c9c020', 1181, N'ITALIAN FOR BEGINNERS AND TRAVELLERS ', N'Members will be able to go to Italy, greet people, introduce themselves, order coffee, buy train and theatre tickets, book accommodation, ask directions, learn the accent, read and write. We concentrate on basic Italian conversation and some grammar. Course book is Berlitz Italian Phrase Book & Dictionary and CD pack. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'023220b2-f79e-4c7a-a593-68c7d06304db', 1182, N'NORTH BONDI - BOOK GROUP', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2e3c2240-42c9-45e0-88a8-68e5f898ca7d', 1183, N'CABINET OF CURIOSITIES ', N'Visual presentations explore the creatures, landscapes, flora and artifacts of classical myths, medieval folklore and New Age fantasy. Loosely based on the elements of Earth, Fire, Water and Wood, topics will investigate shape - monsters, mermaids and strange hybrid creatures. Others examine the influence of authors and illustrators in keeping alive ancient tales to a contemporary audience. (6 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'77c09198-90b0-4e1e-b090-69e0dd477a16', 1184, N'HEBREW (Wahroonga) ', N'Lessons in the Hebrew language and its history - including the impact on Western civilization. New members welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4ac86298-7dd9-46e0-9ded-6a1b5bac96b0', 1185, N'LIVING WITH AGE-RELATED HEALTH CONDITIONS: A WORKSHOP', N'This 2-session workshop, facilitated by a clinical nurse consultant, is an opportunity to explore experiences of living with age-related health conditions including diabetes. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'aea7ae54-41c4-4558-b02f-6a4d7f21832c', 1186, N'FRENCH ADVANCED', N'This is an informal discussion group. We chat, debate topical subjects, read articles, learn pronunciation and have fun while brushing up on our French with a Parisian presenter.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'64e9e4dc-b742-4d0a-8e5d-6aa55cc39eba', 1187, N'PHILLIP ADAMS, THE MAN AND HIS IDEAS        ', N'Philip, a journalist wrote about Phillip Adams after 40 hours of taped interviews with him and meetings with 20 of his friends including Paul Keating, Hugh Mackay, Dick Smith, Bob Brown, Bob Carr and Alan Jones. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'bf7fb90f-e113-4d41-ab3a-6b56fd02efa4', 1188, N'WHAT IS SOCIOLOGY? ', N'A good question deserves a good answer. This is not always possible; sometimes it is easier to say what it is not. It is neither psychology nor social work. It incorporates philosophy, economics, politics, geography, history and education in its analyses. We will examine its uses and practitioners in order to gain a greater understanding of interactions in the modern world.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c2029292-3cba-4807-b2eb-6bd42df8eeba', 1189, N'COMPUTER BASICS COURSES', N'These beginners courses use Windows XP or Windows 7 to teach basic skills - mouse, keyboard, on-screen windows, how the file system works, and using the internet and email. Other topics: security, simple word-processing, using CDs and flash drives, and basic photo management. Class members can nominate topics for the last session.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'70c2f1c5-d794-4478-b836-6d807c095780', 1190, N'FRENCH READING AND WRITING INTERMEDIATE', N'For those having completed at least three years of a preliminary course. The aim of this course is to develop skills in reading, writing and speaking French.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cbcb3a24-a74a-4903-ab57-6dcd44ec7cf9', 1191, N'BOOK CLUB', N'The club reads 10 novels per semester (both classics and modern) chosen by the members who all enjoy a lively discussion on the books read.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'28a2b7d6-a79f-460e-8bc7-6e8135515cd6', 1192, N'AUSTRALIAN PERSPECTIVES ', N'This is an informal discussion group during which the guest speaker introduces us to the varied ethnic, cultural and historical experiences of the people that make up our community.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e5567fc8-7db2-4a9e-adc0-72fb40f3b41b', 1193, N'GETTING TO KNOW YOUR CITY - SECRETS OF SYDNEY', N'Five walking tours to different parts of Sydney easily accessible by public transport and led by a History teacher. Bring a sun hat, water bottle, good walking shoes and a desire to learn more about one of the most beautiful cities in the world. Most tours are free but some include a small entry charge. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'45df48b7-37db-4516-b2c1-731795da8d4d', 1194, N'SPEAK EASY', N'Topical issues and ideas are discussed in a friendly and lively atmosphere. Join our informal forum to continue learning in an active group that enjoys stimulating, serious and not so serious discussion. There is controversy, reminiscing and usually lots of laughter. New members welcome. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'23507101-71ad-4092-9fc6-731f6de1c8e2', 1195, N'CURRENT AFFAIRS FORUM 2 ', N'We discuss and debate actively current events of importance in these two friendly and lively groups which run concurrently in adjacent rooms. New members welcome. (Knox Room)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9ca55469-a57a-4cf6-b8f4-737c39f3a798', 1196, N'A WAY WITH WORDS (Pymble) ', N'In this creative writing course, we combine a variety of writing exercises with the reading of works by members of the group (prose and poetry), which are discussed in a supportive and friendly manner. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd5a34983-6ca7-4b07-abb3-74e0e6713d4e', 1197, N'SPANISH FOR BEGINNERS', N'A two-year course for those attempting Spanish for the first time. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'de2771e9-4955-4088-9f62-7550ff4b7e7a', 1198, N'THE MAGIC OF POETRY      ', N'Explore, enjoy and be inspired by the magic of poetry. The group will read and discuss poems from all places in the globe. The poems will be provided in class. Members are encouraged to present the work of their favourite poet or form of poetry for the enjoyment of the class.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
GO
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8ffa0b42-0cde-4f77-889e-757d542093f2', 1199, N'JULIAN ASSANGE AND WIKILEAKS', N'A look at this complicated issue.   ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'42f51530-1925-4c18-aa2f-7681b2382d4b', 1200, N'TOPICAL CONVERSATION   ', N'Enjoy stimulating discussion on a range of local and global issues. These can include interesting social, political, economic or environmental issues and ideas.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'79ca237c-dfff-4a74-819d-7702fb5192b6', 1201, N'THE HISTORY OF AUSTRALIA AND HER PEOPLE', N'This informal class seeks to understand how Australia developed, the people involved in this process and also to enjoy the contributions of other members of the group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9ec90377-b035-4583-8946-776dd0ad5be6', 1202, N'THE COLUMBIA RIVER AND THE GREAT ICE AGE FLOOD', N'From the greatest flood in human history to the eruption of Mount St. Helens, the Columbia River in America''s north-west has had an impact on the geography, history and human development on a scale not seen anywhere else on earth. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ea4a3282-4cda-40c7-a246-77881eaf7da7', 1203, N'DOCUMENTARY FILMS', N'A wide selection of films is shown on the large plasma screen in our Village Community Centre with subsequent discussion. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'200d1810-d74d-4929-a002-77e41ac27941', 1204, N'BOOK DISCUSSION GROUP ', N'A reading and discussion group with an occasional classic text, but with the emphasis on contemporary literature. The first book will be Hilary Mantel''s Bring Up the Bodies, followed by Jeffrey Eugenides’ Middlesex.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6a684bae-6448-46d4-a002-79d20af125fa', 1205, N'GALLIMAUFRY ', N'A friendly, welcoming group discusses a heterogeneous mixture, jumble, medley: all things philosophical, social and more.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e6a5cf72-15b5-4a5c-af6c-7a35ffca3ce0', 1206, N'PLAY THE UKULELE', N'Do you need some fun in your life? Do you like to sing? Ukuleles are back in fashion! Come and join us. No musical knowledge required. Please ring leader to establish your interest. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a36974f8-360f-42a1-9547-7a870a6e2115', 1207, N'TWENTIETH CENTURY BRITAIN  ', N'Come and explore British society in the first half of the 20th century through literature and with reference to historical events during the period. First novel: Sons and Lovers by D H Lawrence.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'062bc59c-69d7-44eb-a033-7aca565bc020', 1208, N'ALEXANDER TECHNIQUE', N'The Alexander Technique improves your co-ordination and results in smoother, more balanced, movement. Everyday movements such as walking, bending, getting in and out of chairs, become easier and more graceful, lessening the impact of arthritis and other age complications. It also adds to the interest of learning other modalities such as aerobic exercise, Pilates, tai chi and yoga.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'063c9d0b-6e9c-4d2d-88b7-7ad580ba5ad9', 1209, N'FIRST FRIDAY BOOK GROUP**(12)    ', N'Participants are offered the opportunity of discussing their own and other members’ favourite novels in a congenial environment in Glebe. At each meeting the group selects the next novel to be read and discussed. Course Requirement: Book is readily available at an affordable price or can be borrowed from a library. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c3b6092a-a670-4693-8c13-7b4de1fb2ca2', 1210, N'COFFEE AND THE CLASSICS', N'Come and join this friendly group.  As well as enjoying legendary performances from the past, we also listen to many recordings by outstanding conductors and artists of our own day.  Each session focuses on a particular conductor and an added bonus is plunger coffee and quality cookies in the break! ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7b664973-7e3e-431d-8302-7c765138405a', 1211, N'MOZART IN THE MIDDLE EAST', N'This course looks at the ways that Mozart’s interest in the Middle East is reflected in two of his singspiels, The Magic Flute and The Abduction from the Seraglio, as well as in his unfinished operetta Zaide. Music, culture, fashions and a little Ottoman history come together in a fresh way. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1b9aca81-b9c1-435f-8082-7fcc57f93dcc', 1212, N'ROCK ART**(24) ', N'John Clegg, in association with Judith Hammond, offers his expertise on this subject. The focus will be on World rock art and techniques; Australian rock art, the history of its study and recent findings; Sydney Basin rock art. Pre-reading list available on enrolment. (3 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e9723957-ac2a-4076-82ce-80cca5c23766', 1213, N'INTERMEDIATE RECORDER (Roseville)**(12)', N'Play the recorder with a small group meeting not far from Roseville station. Intermediate students only.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'41e20606-e08c-4ef8-af99-80f0553e6b79', 1214, N'DONIZETTI - HIS LIFE AND MUSIC', N'No one wrote more charming comic operas nor tear-filled tragedies than this delightful composer. Come and enjoy!', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5042fca5-0cfa-4f60-8e4f-815ce7c0b70c', 1215, N'GERMAN ADVANCED**(12) ', N'New members welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1f41afa0-bbf9-430b-aeda-8191f8e9f5df', 1216, N'ASPECTS OF ARCHAEOLOGY (Gymea)**(13)', N'Using books, DVDs and VCRs, a variety of cultures are studied for example Mayan, Indian etc.  When appropriate exhibitions are available at the Australian Museum, Powerhouse Museum etc we attend in lieu of a meeting.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4461c336-5bb6-42c9-81bb-81fbcedb5618', 1217, N'FRENCH CONVERSATION', N'Advanced conversation in French based on a text and tape. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e895d23c-ac5a-4ed7-a20d-824da2c4a787', 1218, N'CREATIVE WRITING', N'An ongoing creative writing course - short stories, memoirs and articles, fiction or non-fiction, travel or research on various subjects. We workshop each other’s work with everyone participating. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'885e04b7-75a7-4208-b622-8376250e09c6', 1219, N'GERMAN INTERMEDIATE**(12) ', N'Text books: em neu 2008 Bruckenkurs - Kursbuch Hueber Verlag. Sechs Bausteine: Lesen, Sprechen, Horen, Schreiben, Grammatik, Wortschatz. New members welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'61b68f25-56f1-4c13-9d2f-8418a45703bf', 1220, N'LEGAL LIFE PLANNING: UNDERSTANDING ISSUES IMPORTANT TO SENIORS**(20)', N'This course is designed to provide information that should be considered when preparing end-of-life documents.  It is delivered by retired solicitors and contains general information relating to wills, power of attorney, enduring guardianship, living wills, advanced care directives and estate management. (2 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'dc408a94-c8c0-4f9a-8d51-84c2bc3a4c97', 1221, N'THE iPAD TRAVELLER', N'This presentation demonstrates how to explore the globe with an iPad and Google Earth. Travel the world in 3D, visit popular, mysterious and forbidden places and enrich your travels with your Wikipedia tour guide. Learn techniques for interpreting satellite images and viewing the photo galleries of other travellers. No passport required. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c23321fc-1db3-4cd6-87ef-84eac27b37ec', 1222, N'LITERATURE', N'A wide range of authors and their books is discussed. These include Sarah Thornhill by Kate Grenville - the sequel to The Secret River, The Tenant of Wildfell Hall by Anne Bronte and Bring up the Bodies by Hilary Mantel. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6dad4297-86cb-4e80-a912-8502f0acf44c', 1223, N'THE GOLDEN AGE OF CINEMA', N'We continue to unearth filmic gems from the Golden Age. Hollywood, London and a few other areas provide our source material. The period covered is to around 1950. All programs are carefully researched, introduced, and course notes provided for each session. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f3cce975-77cd-4cf7-aefb-8542a61327a1', 1224, N'MAH JONG (WESTERN STYLE)', N'Learn to play and practice, playing with a friendly group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5b420ff6-c20b-4f14-bcd9-854b34f7b8d2', 1225, N'ART: PAINTING AND DRAWING IN ANY MEDIUM', N'If you are an artist, or would-be artist, haven’t painted for years, or would just like to paint with a friendly group, maybe we are what you need. This is not a teaching group but assistance and appraisals are given. Meet in Northern Amenities Block. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5913d32a-2673-4618-9e1b-865285d2610c', 1226, N'CURRENT AFFAIRS FORUM 1 ', N'We discuss and debate actively current events of importance in these two friendly and lively groups which run concurrently in adjacent rooms. New members welcome. (Calvin Room)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f7bc1c99-8aee-4188-96f8-88094d2505af', 1227, N'SINGING FOR THE JOY OF IT', N'This group is not a formal choir. It is for anyone who enjoys singing for pleasure, irrespective of how badly you can sing. The songs are mainly from shows and are easy to sing. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8505b9f9-c7c0-4eaf-9f2f-8a6d545c0757', 1228, N'TAI CHI**(20) ', N'Learn the ancient art of Tai Chi and gain health benefits through its gentle exercises and relaxation. Tai Chi’s graceful fluid movements combine three forms of exercise: strength, stretching and breathing. Participants should provide assurance from their GP that they are medically fit to undertake an exercise course and have some experience of Tai Chi. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'03955c58-17bc-4484-917b-8a90d850a84f', 1229, N'EAT FOR YOUR HEALTH (West Pymble)**(12) ', N'Learn how to select, buy, store and prepare the foods that will improve your health and reduce your waistline. Good nutrition tips that we all should know. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd7616780-0447-4ffb-ad0d-8b0194002643', 1230, N'LEARN TO ENJOY MAH JONG ', N'Play Mah Jong in a friendly atmosphere in the western game play. All welcome, beginners and experienced.  A limited number of inexperienced players can be accepted. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6c9d8eee-b478-4361-9240-8be6705eef6e', 1231, N'CALLIGRAPHY**(15)', N'Learn ‘beautiful writing’ and discover your artist within.  No experience or talent necessary.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0c65ee12-a7c8-4c74-962a-8bffd10652a9', 1232, N'ITALIAN LANGUAGE AND CULTURE', N'Focuses on speaking, writing, listening and reading Italian at survival level or better depending on the class.  We explore grammar, literature, poetry, history, art, tourism, songs, opera themes, and recipes.  Classes are in English and Italian depending on the topic and the class. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f6e190fb-e876-4203-ae6e-8c699bcf18bc', 1233, N'PAKISTAN - FRIEND OR FOE?', N'Pakistan has a troubled history. Born in controversy and with hostile neighbours, it has alternated as an ally of the West or a facilitator of militancy in Afghanistan, Kashmir and India. Osama bin Laden lived there for some years. We will look at the background of this fascinating country.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a66bd880-d3f8-4d36-851d-8cab7bba2425', 1234, N'EXPLORING AUSTRALIA''S HISTORY', N'An informal class in which everyone is encouraged to participate.  The many facets of Australian history are discussed and guest speakers are encouraged.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ae3fea45-c365-4411-8185-8e67471ca5fc', 1235, N'TOPICS OF INTEREST ', N'A variety of speakers will lecture on their favourite subjects in the comfortable and well-equipped clubhouse auditorium. Comments and questions are encouraged. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2e63645e-d96f-4108-8292-8f084049a191', 1236, N'MONDAYS IN MOSMAN', N'A series of separate presentations on subjects of general interest', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6e585b97-009c-4d74-b667-8fb4f24e5c5e', 1237, N'BIRDS IN THE ENVIRONMENT  ', N'In four field trips we will observe how the structure of various habitats directly influences the types of birds that live there. Participants should wear good walking shoes, protection from the sun and insects, and carry water. Bring binoculars if you have them. Entry to the National Parks will be at one’s own expense.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'07e14e98-768b-4a0d-aaba-90544e1ab85b', 1238, N'DAME MARY GILMORE’S QUEST FOR UTOPIA', N'Dobell’s dignified portrait of Dame Mary Gilmore belies her radical past. We follow young Mary’s career as poet, journalist and political activist, including her failed quest for Utopia in Paraguay. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4a8e2f8d-bf37-403e-b79d-9160f609751e', 1239, N'FRENCH 2.0**(12)', N'Minimum requirement of 20 hours recent French.  Focus on speaking, listening and pronunciation, rather than reading.  Handouts provided at minimum charge to cover printing costs.  Access to a private Yahoo Group online.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'52fe9e5b-30a2-4942-8aa3-92361e6084fc', 1240, N'A STUDY OF SOME NSW PASTORAL STATIONS      ', N'We shall look at their history, station life, modern diversification and farm stays. (6 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b6d2f44d-eb61-4378-a61d-93efef55d058', 1241, N'IS HISTORY FICTION? ', N'Is history something different from or similar to narrated stories? Is it a tale told by the victor? We examine seven contentious wars/geological occurrences that influence our views about the shaping of the modern world. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b1932264-3afd-472b-b483-953084fb927f', 1242, N'HISTORY OF HUMAN RIGHTS', N'There has been much discussion regarding the necessity for an Australian Charter of Rights but little reference to its fundamentals. What is a right? Where do rights come from? Why a Bill of Rights? Would it work? We discuss these questions and much more.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'023b7449-0dc4-48e0-908a-95b3326f420f', 1243, N'YOGA FOR BODY AND MIND    ', N'A class for everyone interested in discussing and becoming aware of tensions in mind and body through practising gentle yoga exercises and breathing, designed for those with little or no experience at all, as well as the more experienced.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'08508963-54d0-4db6-b470-95c4962526c6', 1244, N'THE VIETNAM EXPERIENCE', N'Vietnam, its people, culture, beauty and history, this course will whet the appetite for more, through the eyes of one who has been involved for 20 years and author of Scales of the Dragon: the Vietnam Experience.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b21782d7-4673-4db4-b084-96e4a2bb83f4', 1245, N'FURTHER BRIDGE FOR BEGINNERS', N'The assumed knowledge for this continuing course is an understanding of basic bidding, finding a fit, playing to game, basic responder shifts and play in suit and no trumps contracts. Topics will include overcalls and doubles, Stayman, Blackwood, pre-empts and more. Time will be available for supervised play. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e760d467-ad44-4ffe-85f3-96ff07c90c04', 1246, N'DRAWING**(12)', N'We use black and white (charcoal, pencil, ink), with some other media, e.g. Conte. The basics are covered including tone, perspective, composition, etc. Students are encouraged to suggest topics. Weather permitting, we draw outdoors and occasionally visit art galleries. Only an interest in drawing is required. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1f7d7f78-e5c1-497e-9c65-976b3819a838', 1247, N'CO-OPERATIVE YOGA AND RELAXATION**(20)    ', N'This course is for experienced yoga practitioners who share their knowledge in a collaborative atmosphere. Beginners are made welcome. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f26bc51f-ae46-49ec-97cf-9822f3af97de', 1248, N'FRENCH BEGINNERS LEVEL 2  ', N'Learning to speak read and write French.  We use the textbook French Made Simple.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2b9d8cfd-605c-4c39-b5e9-985a89bfde11', 1249, N'PUBLIC SPEAKING WORKSHOPS**(15)', N'Learn the basics and begin practising public speaking with a leading practitioner with 30 years experience. It’s never too late to become confident ‘on your feet’.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4335be74-ee7e-4f97-903e-98847537b1a9', 1250, N'HISTORY OF ENGLISH LITERATURE (Rozelle)   ', N'We are currently studying and discussing 19th century literature. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'ccb6e9df-25f3-435e-9af7-98c8311ea62a', 1251, N'GOSSIP OR TRUTH ABOUT PLANTS', N'Meet a plant family up close. Our first meeting discovers the varied habits (some not so nice) of figs and their relatives, even if Adam was a fan of their leaves. Illustrated portraits and surprising stories reach across time and place. Entertaining and fun.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'31dd0715-e045-4ab7-9acc-990e532ef2bb', 1252, N'ANYONE FOR MURDER? (Merrylands West)**(10)', N'Participants will be offered a selection of DVDs and videos of murder mysteries featuring well-known fictional sleuths such as Frost, Morse, Colombo, Barnaby, Miss Marple, Hercule Poirot and Inspector Lynley.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'70cedb7e-843f-4a14-96b3-9b305c9903d7', 1253, N'SECRETS OF THE MUMMY', N'Learn the secrets of Ancient Egypt from a life-sized Egyptian Mummy.  Topics include the Tombs of the Pharaohs, Egyptian gods and religion, mummification, hieroglyphics, King Tutankhamen and Egyptian art.  The course will be supplemented by DVDs and recreations of Egyptian artefacts. Group discussion and input encouraged. (9 or 10 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'99b82bf2-f1cc-4dd4-bf76-9c1081532a88', 1254, N'BRIDGE FOR ADVANCED PLAYERS (North Parramatta)**(8)', N'Bridge for advanced players in a non-competitive atmosphere.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'20ab6f48-ac2e-4f37-a8ff-9cac21805a44', 1255, N'TOPICAL CHAT**(12)', N'Bring along your ideas for light-hearted discussions with fellow members.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'22d88af3-fd16-43e0-a0ab-9e3b46a80bc2', 1256, N'YEUNG’S TAI CHI CHUN         ', N'Tai Chi is a popular Chinese traditional culture that was established over three hundred years ago .Tai Chi is a very good way to maintain health, longevity and an easy way to exercise.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4edde6e9-a4cc-429a-ada9-9e98f6b1868e', 1257, N'ART PRACTICE GROUP ', N'Love art? Then join this fun, relaxed class. Whether you are good at art or want to be good, this is the place for you. Experiment with any media, explore your own style and develop your creative expression by learning to look. Bring your own materials. Beginners are welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'bd29c8e9-79d0-447a-b4a2-9eb4d34562fb', 1258, N'HALF-DAY BLOGGING WORKSHOP**(6)', N'With an illustrated blog you can keep friends in touch with your activities, or proclaim your thoughts, insights or prejudices to the world. You will use simple software to easily create and maintain a blog. You can open it to the whole world, or restrict it to a chosen few.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'00349bb4-d7b2-4e12-aaf6-a0592087d80c', 1259, N'FURTHER BRIDGE', N'This course is for participants who have completed the Bridge for Beginners and Further Bridge for Beginners courses with U3A, or equivalent. There will be time for further lessons and supervised play. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0ee1d908-49d7-41b4-b71e-a081270a96e1', 1260, N'FRENCH READING AND WRITING ADVANCED**(10) ', N'Suitable for those having a good basic knowledge of French grammar and pronunciation.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'670106a1-db86-4824-8181-a09e1b4ac245', 1261, N'BRONTE - BOOK GROUP', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4985a19a-9ef3-4f38-b6f6-a138c6f8265b', 1262, N'LAST FRIDAY BOOK GROUP', N'Share your interest in books with other readers.  At each meeting the group decides the next novel to be discussed, with the condition that it is readily available at an affordable price or can be borrowed from a local library. (5 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3ba26212-b6ee-47f0-8f16-a21634d8f879', 1263, N'SPANISH CONVERSATION**(10)', N'Most of the time we discuss current affairs, cultural events or a subject previously decided upon. Spanish is spoken 90% of the time. Good knowledge of the language is required.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'622e61d8-4bac-4051-a521-a2557ea30dc7', 1264, N'CITY QUARTER BOOK GROUP (Inner West)**(8)   ', N'Increase your enjoyment of reading by sharing your ideas with others.  Every four weeks we will read and discuss a book, choosing from a wide range of literature.  First book in February will be Bring Up The Bodies by Hilary Mantel.          ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'acb98e55-2773-4efd-8b05-a25dd80e6dcc', 1265, N'VISITING REGIONAL GALLERIES', N'Using public transport we will visit regional art galleries to see a diversity of art. More details available on enrolment.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6f8d2841-7d34-4349-8e53-a2fa586f20e5', 1266, N'DECONSTRUCTING CONTEMPORARY ART**(25)    ', N'This group visits vibrant contemporary art in Sydney galleries and beyond, and on alternate Thursdays meets at Customs House Library for discussions. We build a virtual (and real) art collection, discuss art news, events and theory and develop new ways of interpreting current concerns along with a personal aesthetic. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8ee0260c-359e-4e0d-a205-a351326c225f', 1267, N'CURRENT AFFAIRS DISCUSSION GROUP', N'This group will discuss topical subjects that affect or interest us all - lively debate is anticipated on international and national current affairs, as well as looking at local issues. You will be welcome to contribute or, as some people prefer, to listen and learn.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2aeafcaf-81da-4ad9-bf25-a394ea6ec65a', 1268, N'THE MIDDLE AGES', N'We take an in depth look, profusely illustrated by picture and film, at the wide ranging achievements of the European Middle Ages which underpin the modern world with a special focus on Gothic cathedrals and the charismatic figure of Joan of Arc and demolish the myths surrounding this period', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd3010642-5ed0-427e-bfc0-a498b1c96795', 1269, N'HISTORY OF ART', N'This course takes a look at the works of artists over the centuries. Various members of the class will present an artist.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'067b5cb4-37a1-4216-9f06-a5154de5ec47', 1270, N'TOMBS OF THE PHARAOHS      ', N'Learn the secrets of Ancient Egypt. Topics include the Tombs of the Pharaohs, Egyptian Gods and Religion, Mummification, Hieroglyphics, King Tutankhamen, Egyptian Art. The course will be supplemented by DVDs and re-creations of Egyptian artifacts. Group discussion and input encouraged. (8 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b1e83ca6-8a60-4b25-a3dd-a5d1301d6b62', 1271, N'CLASSIC MOVIES** (20) ', N'A selection of the best and most influential movies which developed the industry will be presented with some analysis and background pertaining to cast, director and production. A full list of movies will be supplied at the first performance. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0e948c30-3e8d-4fdb-a4bd-a6848d6599b7', 1272, N'BOOK DISCUSSION GROUP', N'All books will be selected from a wide range of literature, fiction, non-fiction and biography chosen by the group. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f97b4051-db0b-46d3-970a-a69bce7b4e7d', 1273, N'BOOK BANTER (Caringbah)**(12)', N'Each month we read a book chosen by our members. We discuss the author, the plot and the characters.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'efb6cb14-b9f9-49c4-af2b-a76fa8ef6656', 1274, N'CREATIVE WRITING', N'A small self-help writing group. Each member contributes both in writing and editing. Over the years several members have published. Choice of writing material is up to each member. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'54ab593a-443a-443c-b80a-a7e56f04fd5e', 1275, N'FILM DISCUSSION**(20)', N'Do you enjoy going to the movies and would like to share your opinions with others? A discussion of acting, characters, plot and cinematography will be held on 1 or 2 nominated movies a fortnight.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b1fb793c-3798-4ed9-aaf0-a87453bdd5f9', 1276, N'YOUR BRAIN MATTERS', N'Your Brain Matters is Alzheimer''s Australia''s new brain health program, designed to help Australians live a brain-healthy life. This program looks at age related changes, dementia and risk reduction strategies.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'33983dc8-1560-47b2-94e1-a898b8826c18', 1277, N'COMPUTER TUITION, LEARN THE BASICS ', N'Assisted self-study, with the help of tutorials. Bring your own Windows laptop computer. Choose your topic from this list: Windows, Internet browsing and buying, email, Google, Picasa, Maps, Calendar, YouTube, Skype, MS Word, Excel, PowerPoint and Apple iTunes.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7a81ddd0-5064-4a22-832e-a9496b9882dc', 1278, N'FRENCH BEYOND BEGINNERS**(12) ', N'For those who already have a little knowledge of French. Emphasis will be on conversation, but with some grammar and revision. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c4c4e195-d4c6-426d-86e3-aa2320bf752b', 1279, N'ROMAN HISTORY: A TRAVELLERS GUIDE TO THE ROMAN EMPIRE ', N'Much of the classical past still remains throughout Europe, North Africa and the Middle East. The arches, temples, theatres and amphitheatres, aqueducts and baths; where can they be best seen? What do they tell us of life in the Roman Empire?', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1ff6ef90-3852-4af3-be72-aab15e285600', 1280, N'FRENCH INTERMEDIATE**(18)', N'Covers grammar, vocabulary, listening and conversation.  Use will be made of audio and videotapes, supplemented by written texts.   ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c73ea347-3cd9-42b9-9897-aac8ffe7d882', 1281, N'MOSTLY MOZART (Lilli Pilli)**(8)', N'Join us for a pleasant afternoon listening to mostly Mozart, and enjoy a continental afternoon tea.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'699ba015-5a99-4162-bf77-aae758abd2ef', 1282, N'GUIDED CITY BUSH WALKS**(20)   ', N'Easy to medium walks in and around the city. Participants learn something of our urban history and explore some of the beautiful bushland close to our international city.  Walks generally finish at a watering hole.  Requirements: strong walking shoes/boots, hat, sunscreen, wet weather gear and plenty of water.  Mornings, finishing noon/mid-afternoon. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'60397665-7c26-4418-85c0-ab0176c38ec5', 1283, N'CONTEMPORARY ISSUES', N'A friendly forum at which matters of public interest are discussed and debated, all participants being free to express their views openly and nominate items for the agenda. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0205bc6a-f1c3-49e0-9634-aba04568649b', 1284, N'RECORDER', N'We are an enthusiastic group of recorder players - descant, treble and tenor. If you are fairly competent in any of these instruments we would love to hear from you.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3dc57970-54d4-4c89-9e42-ad380c91f195', 1285, N'GREAT BOOKS OF THE WESTERN WORLD ', N'This course commences with Fyodor Dostoyevsky’s The Brothers Karamazov and includes a play reading of Anton Chekhov’s Three Sisters.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'649203a8-df46-4ae6-bc07-ad801dc013f6', 1286, N'INTRODUCTION TO LINUX**(7)', N'Intermediate course for people with sound experience running computers. All Linux programs are free, and it reads and writes Windows and Apple files doing 99% of what they can. You will learn skills you can build-on later, including safe installation alongside Windows and Apple. We will use ''Ubuntu'' or a variant.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd2e65650-18c6-4133-adce-b022de37b390', 1287, N'STOCKS AND SHARES REVIEW', N'This is a second level course suitable for people who have attended the Demystifying Shares course. Others who understand fundamental or technical analysis techniques are most welcome. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5c7d70fb-bf02-4db5-89ed-b03ec68dca50', 1288, N'WEDNESDAY AFTERNOON AT NEWPORT', N'A series of five open lectures on a range of interesting topics. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2307696f-8aa5-4fdd-8f60-b0dec8f51517', 1289, N'INTRODUCTION TO MUSIC READING THROUGH THE RECORDER', N'For people who have never studied music and would like to unravel the mystery of music notation, and for those who have always thought the recorder is just for primary school children. This course will introduce you to the joys of ensemble playing and a peek into the world of early music. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b83a5cca-66f1-45e8-b22a-b1b908d47027', 1290, N'THE REFORMATION', N'The time of the Reformation was a tumultuous era which included schism of Western Christianity and one of the longest and bloodiest wars in European history. The religious thought and history surrounding this time will be examined. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a6f470bd-1f49-49da-839c-b2e31e6fa1d7', 1291, N'POINT OF VIEW', N'This is an interactive group seeking to expand its knowledge of the world by drawing on history, personal experiences and current affairs. Discussion is the corner-stone and entertainment is a by-product. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'980c3352-5ad7-4290-ac6c-b3f949e96d4a', 1292, N'WRITING CREATIVELY**(10)', N'A small friendly self-help group where you can develop your writing skills and share your stories and life experiences. Beginners welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5f877a38-a207-4051-ad9c-b452ff3ca7a5', 1293, N'PERSIA PART 2', N'More on ancient (and modern) Persia, especially Zoroastrianism, food and wonderful carpets. We will also look at Hafez, often called ‘the greatest poet ever’.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'73b8fa53-34e4-4852-9b4e-b462619f8bdf', 1294, N'MOSMAN ART GALLERY EXHIBITION VISIT SERIES ', N'This, the second session, will introduce you to the lives and work of some of the women artists of Mosman, and guide you around exhibitions by two modern women artists.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4d26b773-6545-4688-8ac2-b4f0a9f3a66e', 1295, N'MY WORD', N'Love the English language?  Wonder how our idiosyncratic sayings came about and what some of those peculiar words mean?  Come along to expand your knowledge and write creatively in an enjoyable and easy-going environment.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'156f2c01-3418-4275-9b9f-b65805710792', 1296, N'WHAT HAPPENS TO SUPERANNUATION WHEN YOU DIE? ', N'The aim of this course is to focus on those issues of most concern to members. So feel free to outline these when booking in if you would like to do so. No investment advice can be given. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9959c421-862b-4331-a83a-b681d879305d', 1297, N'THE UNITED STATES POLITICAL SYSTEM', N'Is it dysfunctional? An analysis of how the US political institutions are dealing with major issues in an atmosphere affected by the recent presidential and congressional elections. Topics such as forward engagements, deficits, sustainability, polarization and health care are among the many to be considered. (2 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'180a8acc-288c-480c-b84c-b7480cdb0ee1', 1298, N'BECAUSE IT IS THERE', N'A study, illustrated by picture and film, of the life and achievements of George Mallory before and on Mount Everest, and whether he made it to the summit in 1924! ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
GO
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd0b9200f-471a-43d6-86b8-b826eac2b545', 1299, N'BOOK DISCUSSION GROUP**(12) ', N'A book group centred on literary fiction. Our book for the first session is Flaws in the Glass by Patrick White. Group limited to 12 to ensure everyone has a chance to speak. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'60cf4150-ba1f-4b35-b432-ba31128e1afe', 1300, N'WRITING CREATIVELY', N'Learn the skills of transforming experiences into prose and poetry and share the results in a friendly supportive environment. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1ac8e412-b29a-49a9-ace0-babd92512e74', 1301, N'ITALY: THE COUNTRY, THE PEOPLE AND THE LANGUAGE', N'Italy is more complicated than it seems. In each session we shall discuss the country: its origins and history, and the people, diverse by origin, language and temperament. The third component of each session will consist of basic communication skills in Italian and what to do if words fail you. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f92360ab-c50f-4803-9f99-bb2eafea3e93', 1302, N'DISCOVERING POETRY         ', N'What’s the difference between prose and poetry? How does poetry communicate? How do I heighten my response? You are invited to explore the poet’s world to see things as they do with fresh eyes and ‘felt thought’. Bring pen and pad for your enjoyment of the romantic poets and others. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5d0f1430-bd81-4128-9917-bb6e8f2409ae', 1303, N'SOCIAL MEDIA FOR SENIORS ', N'This course examines the impact of the current social media revolution on society, business and education. The course emphasises how seniors can use social media for lifelong learning in their areas of interest and write and publish stories for family, friends and profit. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c1cf8a95-1737-47a0-9044-be054d81f9e5', 1304, N'SUPERANNUATION AND ESTATE PLANNING', N'The aim of this course is to focus on those issues of most concern to members, so feel free to outline these when booking in. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'2f66ea38-fed8-4311-95d5-be3f33bbbffa', 1305, N'RUSSIAN ADVANCED**(12)', N'This is a continuing course where new members with an adequate level of Russian are very welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6155b5d7-0e7e-4ea9-b2bb-be851a23d007', 1306, N'THE JOURNEYS OF MATTHEW FLINDERS    ', N'Matthew Flinders is well known as the sailor who named Australia. This talk will examine all the journeys he conducted around Australia and the trials and tribulations he experienced.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'e3abb972-1137-42bd-9152-bedd34f8a3ff', 1307, N'FRENCH INTERMEDIATE', N'Some previous knowledge is required. Course covers basic grammar, reading, vocabulary and conversation.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'34e12b6d-a7c2-4f0e-bd0d-bf1280e48c74', 1308, N'MUSIC MATTERS', N'This popular course continues exploring the fascinating world of classical music and the lives of composers and performers together with musical ideas and themes. Learn about the much loved, the unfamiliar and hear interesting stories from the world of music and musicians. Come and enjoy some wonderful classical music from great recordings.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'58a67bdc-d31c-491f-a1f8-bf859ec03f33', 1309, N'THE GOLDEN YEARS OF POSTER ART', N'This series presents exemplary poster art of the last two centuries: from the French period of Toulouse Lautrec, we continue through the Art Nouveau and Art Deco periods in Europe and Jazz Age in the USA. We conclude with posters from Australia that examine, confront and comment on contemporary issues.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'162717c5-4109-466d-8fa9-c0761c13a3a6', 1310, N'READING AND DISCUSSING SHAKESPEARE ', N'We conclude our journey through the history plays with Richard III. Then we address the tragedy of Hamlet, Prince of Denmark. Please bring a copy of each play with numbered lines. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1f50029d-c06b-4472-9d31-c098e682b54a', 1311, N'READING SHAKESPEARE', N'Reading Cymbeline. Harold Bloom says: ‘Cymbeline is a pungent self-parody on Shakespeare’s part’. Let’s see if we agree with him. Bring a copy of the text. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'fa3fc2a5-26ca-4548-8924-c1248111c02a', 1312, N'INTRODUCTION TO SOCIAL MEDIA**(6)', N'Beginners workshop for people who want to understand the essentials of the ''Social Media'' phenomenon. This session will acquaint you with the likes of Facebook and Twitter and the concept of web-based instant information and comment. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6969f6ff-9cd7-4bc1-87fa-c13aafbdbf75', 1313, N'QiGONG: AS RELEVANT TO LIFE**(21)', N'Based on the Oriental concept of Creation spirituality these QiGong classes are geared towards the harmonizing of our three enlivening centres - breath, heart, spirit - and incorporates the five elements. This is a component of Traditional Chinese Medicine.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'320e6b33-b15c-44ef-bb56-c1b4a6f0a8ae', 1314, N'MUSICAL FAMILIES', N'Six sessions of classical music on various themes.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a64ae587-a426-4ab2-9a22-c1fbbdca6bd0', 1315, N'RECORDER GROUP', N'This course is for people who enjoy playing the recorder and would like to join an established group. We perform a wide variety of music at intermediate level (not for beginners). ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8e72d133-34fc-40a9-a6d8-c2b2bededda2', 1316, N'CREATIVE WRITING**(10) ', N'A lively writers group where we share our writing for appreciation, comment and positive feedback. We work through tutor''s points and publication is encouraged.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd8ed6485-e037-4d41-a5f6-c2ea3c53a4a3', 1317, N'BOOK DISCUSSION GROUP', N'Our friendly group continues reading great classics - old and new, biography and non-fiction as well as drama and poetry. The book chosen for our first session is The Brothers Karamazov by Fyodor Dostoyevsky. New members welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'430682d3-eaad-44ea-a67e-c31bbd519721', 1318, N'LET THE GOOD TIMES ROLL!', N'Where were you in ’62? A music appreciation course with a strong emphasis on Rock n’ Roll from 1955 - 1962, listening and discussing how it played out in Australia, UK and US pre-Beatles. Relive and enjoy the music of a simpler era. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'436dfb8e-d0d5-4b4c-ad1f-c3419a0aa3be', 1319, N'A CHEST FULL OF MEMORIES ', N'This presentation will reflect on significant changes in the treatment of heart and lung conditions and the development of cardiac surgical procedures from a nursing perspective.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4d716dee-619a-4808-9fb0-c46e2418423d', 1320, N'TAI CHI', N'Tai Chi has been said to relieve stress, arthritis and blood pressure.  Assist in the mobility of mind and body.  Aid blood circulation and muscle toning.  Beginners, intermediate and advanced classes.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6f573987-27a5-4ef0-92ab-c47023a2d1c0', 1321, N'THE iPAD TRAVELLER', N'This presentation demonstrates how to explore the globe with an iPad and Google Earth. Travel the world in 3D, visit popular mysterious and forbidden places, and enrich your ‘travels’ with your Wikipedia tour guide. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7b52c160-c11d-48e5-93ee-c479b84b17a6', 1322, N'PHILOSOPHER’S CAFE**(10) ', N'The course objective is for participants to emerge with greater knowledge/understanding of/respect for different viewpoints. Topics selected by participants and facilitated by course leader in a social enriching and interactive environment. Principles of Dialogue: an examination of built-in assumptions, embedded concepts, differences of kind, degree, and logical consistencies/inconsistencies. (7 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b3b75293-cecb-440a-9e76-c47a98978e47', 1323, N'FRENCH INTERMEDIATE**(10) ', N'For those having completed at least four years of a preliminary course. This course aims at developing the student’s skills in reading, writing, and speaking French.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cf4bd6ff-c1a4-484b-b0e8-c4989ee0f0d0', 1324, N'PSYCHOLOGY**(18)', N'The study group determines the topics for discussion.  Members research each topic and share their discoveries.  Topics can range from classical and modern psychological theories, famous names and their ideas, (eg. Freud, Perls, Maslow etc).  The first meeting of the semester will focus on the work of Susan Carey.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'895bbdb2-bb8b-4c2d-a7fb-c49e907a521d', 1325, N'PHILOSOPHY ', N'This year we will study philosophers from the late 19th century onwards. Members are encouraged to assist with research, thus enhancing the level of discussion. (Gilmore Annex)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f4504f91-6092-47df-b327-c5bfecd5fe00', 1326, N'TAKING PANORAMIC PHOTOS ON YOUR CAMERA**(7)', N'Intermediate course over two afternoons, shows how any digital camera can take panoramic photos, either horizontal or vertical, ranging from just 2 or 3 photos wide, up to a full 360 degrees. Free software is used to ''stitch'' the photos together and ''play'' them like a video either as a stand-alone program or on the internet. Bring your camera and its computer transfer cable.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5164a4a5-6b6a-4118-b1b2-c5ff1060d4ea', 1327, N'GERMAN CONVERSATION**(8)                   ', N'Intermediate to advanced conversational German.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'731e6690-4172-43ef-ac46-c668721a6f08', 1328, N'PEN AND INK DRAWING**(15)', N'The idea is to introduce you to pen and ink drawing, sometimes adding a little wash. There are many techniques used in this media, you will experiment with each one producing a dramatic art work. Beginners welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8e13f6f3-bfa4-44d0-b9ae-c6fdad85fc00', 1329, N'AWARD WINNING NOVELS**(10)', N'Friendly group meeting, to discuss award winning novels - or novels any one of the group thinks should have won an award! ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f51146ac-7c66-4bab-9cea-c7e87931504c', 1330, N'MUSICAL MASTERPIECES ', N'Appreciation, assessment and comparison (compare and contrast) relating to selected masterpieces of the major composers, which will include concertos for violin and cello. This class is now in its fifteenth year. (Wesley Room)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'97161e34-9ffd-4cfc-b7cb-c7fe09eb9d47', 1331, N'ANCIENT GREECE AND ROME', N'This course covers Ancient Greece and Rome and the rise of Christianity therein with emphasis on political and social nature. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cf668da3-3005-4efc-936b-c807e1ff5f5a', 1332, N'DISCUSSION GROUP: SOCIAL ISSUES AND CURRENT AFFAIRS   ', N'Each fortnightly meeting is divided into two sessions by a tea break. First session: Topic for discussion is prepared and presented by any group member who volunteers. Second Session: Current Affairs - no subject taboo - a friendly, intelligent group of men and women where everyone is encouraged to participate. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7f6f670e-fb84-4230-8110-c8973d2cd671', 1333, N'THROUGH THE DECADES: A SOCIAL HISTORY OF AUSTRALIA', N'Over three sessions, David Dale explains how Australia changed from one of the dullest places on the planet to one of the most exciting. Week 1: the 50s and 60s. Week 2: the 70s and 80s. Week 3: the 90s and Noughties.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'543c125d-3751-4270-8446-c921443b2e5c', 1334, N'PLAY READING (Wahroonga)', N'No need for acting skills, just an interest in reading plays with a friendly group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1d36ea89-f6b5-4622-8d03-c9eb6e59268b', 1335, N'DISCUSSION GROUP', N'Would you enjoy sharing and exchanging various ideas? We explore a subject chosen by the group as well as spontaneous individual contributions.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd384ecd3-7eb2-4067-af50-cab6fc4ccf12', 1336, N'MONDAY CANASTA', N'Canasta is a great social card game.  With a friendly supportive group, take this opportunity to learn the rules, plus refresh or polish up your skills if you have played before.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'547a8f0d-2f93-4a08-960c-ccc241dc1d7a', 1337, N'MANDARIN', N'This course is intended for the third age people who want to learn Mandarin, by means of learning Chinese characters and sentences using alphabetic transliteration.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'524eeb17-1396-413d-8ec0-cecdc102cbbd', 1338, N'BALMAIN BOOK CLUB**(10)', N'Each month we will read and discuss a chosen book. Members are also encouraged to select a book they would like to discuss.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b0131ca9-5914-4c43-8a67-cf039be5f74d', 1339, N'80 YEARS OF JAZZ', N'A broad-brush look at jazz music from the early traditional jazz of the ‘20s, through the Big Swing bands and to bebop and the ‘cool school’ of Miles Davis and others. There will also be examples of women in jazz, singers, jazz in Europe and some unusual instruments in jazz', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0fdc138c-112f-4f75-a4f7-cfab2d7f39c3', 1340, N'UNIVERSE OF STONE', N'A profusely illustrated look, in words, picture and film, at the origin, development and meaning of the unparalleled human achievement of the glories of Gothic cathedrals. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6fd1c7b7-26b7-4781-9c33-d03c072728eb', 1341, N'A SHORT COURSE ON AUSTRALIAN SHORT STORIES    ', N'Out of the wide range of short stories written by Australian writers, we will consider some outstanding examples from the work of writers like Glenda Adams and Barbara Baynton, as well as two stories called The Drover’s Wife. (2 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'130b0ea5-425a-47ca-8179-d06d69157cac', 1342, N'WRITING POETRY**(12)', N'This group explores the magic of poetry in all its various forms through reading, appreciating and writing poetry. We give and receive friendly, positive feedback.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7a4ba9ed-883e-45d6-8274-d0aca5ed6d3e', 1343, N'SCHUMANN - BRAHMS - DVORAK', N'We will consider the intersecting lives of these three great 19th Century composers, all illustrated with examples of their finest music. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'16288c53-bae5-4775-a83d-d2aa46535edf', 1344, N'UKULELE GROUP', N'Did you ever want to play an instrument but were too scared to try? Well, here is your chance. Come and learn the ukulele. No prior music knowledge needed, just willingness to join in strumming and singing and having fun. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cc327cba-7ae4-433e-9c78-d3bed0fe844f', 1345, N'MUSIC FOR PLEASURE: THE CLASSICAL ROMANTICS**(18) ', N'Music for pleasure: Classical Romantics - 19th and into the 20th Century.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4d6ef033-56c3-4fff-a54a-d5536c8d81f9', 1346, N'MONDAYS AT ST. IVES ', NULL, N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9787418c-2727-4297-b27b-d62d439de350', 1347, N'THE WORK OF THE AGE DISCRIMINATION COMMISSIONER    ', N'Susan Ryan was appointed Australia’s first Age Discrimination Commissioner in July 2011. She will speak about her role, the protections provided by the Act and her priority areas of work. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3563ef17-d332-41cb-9ed8-d65bfba0b913', 1348, N'LIFELONG LEARNING FOR SENIORS', N'The iPad provides a great opportunity for seniors to engage in lifelong learning with experts and other learners around the globe. These two presentations will demonstrate how to use a wide range of iPad learning tools and access free learning materials from the world’s great universities and colleges, and how to create your own global learning networks for acquiring knowledge in your own areas of interest. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f6dd68af-19c1-408c-b490-d6c7a8688047', 1349, N'YOGA ', N'Yoga for everybody, beginners to the experienced will enjoy the benefits of correct breathing, bending, stretching, twisting, balance, mind control and relaxation. Yoga is about health and well being and now is a good time to start. The class leader is an experienced, certified and practicing yoga teacher. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5a79ed83-53a0-43d0-a072-d99da9932244', 1350, N'ASIAN RELIGIONS', N'This course will look at the history, beliefs and practices of the major religions which originated in India, namely Hinduism and its offspring - Buddhism, Jainism and Sikhism; from China, Confucianism and Daoism; and from Japan, Shinto.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'fdf3a1df-3fc4-40d5-9b15-d9f8d0d6b797', 1351, N'EXPLORERS IN WESTERN AND CENTRAL AUSTRALIA', N'In four separate sessions the journeys of Edward John Eyre, George Grey, Ernest Giles and John McDouall Stuart will be investigated. Their experiences with harsh environments and the native inhabitants will be examined and as well as their impressions of the country through which they passed.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f1253eda-7080-4fdc-900b-da113f356869', 1352, N'ROMAN WIVES AND SLAVES THROUGH THE EYES OF CICERO, SENECA AND PLINY. ', N'Through an exploration of actual Latin texts, we learn the truth about Roman wives and slaves.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3000c5ec-eae0-4469-a26e-db53144e61ad', 1353, N'TODAY’S CHINA IS CAPITALIST AND COMMUNIST. HOW COME?', N'Understanding what makes China ‘tick’ is vital for Australia today. As we discuss this, the leader will share insights gleaned since welcoming the first Chinese students who came to Australia in 1975. In the 1980s and 1990s in China, Val taught senior university students English Literature with the History of Western Thought and Culture. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'157502f3-7995-4d04-b52a-dbb338783856', 1354, N'THE ROMANTIC AGE OF SCIENCE', N'Based on the book The Age of Wonder by Richard Holmes, this course introduces the scientists who, at the turn of the 18th century in Britain, brought imaginative intensity and excitement to science. Meet Banks, Babbage, Davy, Jenner, Herschel, Rumford and others who inspired contemporary writers and artists.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8dc3ca2c-b692-41c6-8736-dbca4c5757e8', 1355, N'FILM GROUP**(15)', N'A series of courses considering motion pictures in a thematic way.   Generally, the time period covered is the 1930s, 40s and 50s.  Themes include genres and the work of directors and actors.   A film is shown at each session with members encouraged to consider the work in its historical context.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'810d212a-f799-4ae9-b14c-dcd560dfa07a', 1356, N'THE JOY OF GARDENING', N'Soils, food, sun, water, biodiversity, monocultures, pesticides, and herbicides. Gardening in small places with both edibles and ornamentals. Lots of tips, ideas and planting suggestions plus general Q&A sessions after morning tea. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'9bbabdf9-586c-4f22-92e4-dcdadb21f812', 1357, N'FRENCH STAGE 3', N'This course concentrates on grammar, self-expression and civilisation. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0abce251-8b0e-4ee2-ab4d-dcec1ae5a1b0', 1358, N'THE CHINESE OPIUM WARS  ', N'How an ancient culture was corrupted and destroyed by British greed. A sad indictment.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'83ad19dd-fce3-43d0-8d9f-dd21711037c2', 1359, N'FRENCH CONSOLIDATION**(20)', N'Ce cours s''adresse a` ceux qui peuvent de?ja` se de?brouiller en francais. On met l''accent sur la comprehension orale.  Text: The French Experience, Book 1 plus four audio CDs by Marie-Therese Bougard and Daniele Bourdais', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1d497cad-d743-4d93-bb39-de3042b0a8f5', 1360, N'FRENCH CONVERSATION INTERMEDIATE**(15)     ', N'The class aims to improve conversational skills in French for tourist purposes. We also discuss other matters of interest such as films, television and books. We read articles on various topics to improve pronunciation and translation and we touch on grammar as required.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'07b2b6ab-62fa-4ea5-970d-dec206005aee', 1361, N'INDONESIAN INTERMEDIATE**(10) ', N'Indonesian is by far the easiest Asian language to learn to speak, read and write. It is closely related to Malay. Both Malay and Indonesian are written like English and other Western languages, i.e. they use the Latin alphabet. No difficult writing systems to learn! Textbooks used: Colloquial Indonesian, by Sutanto Atmosumarto, chapters 8 - 12 (publisher Routledge) and Bahasa Tetanggaku Stage 2 by Ian J. White (publisher Longman).', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'c692baea-c113-40b6-b315-deea434cf592', 1362, N'FOCUS ON ASIA', N'In this series we will consider the background to the latest current event/crisis/calamity in Asia - our region. Each topic will be decided closer to the date and will depend on what is in the news. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'11558f37-bafb-4147-9865-df958c53ec45', 1363, N'EXPAND YOUR KNOWLEDGE OF ENGLISH AS A SECOND LANGUAGE  ', N'We investigate various aspects of English including grammar, pronunciation, spelling, formal and informal speech and writing, and idiom usually from a newspaper article or short story. To join, you need at least a beginning level of spoken and written English and you should be literate in your first language.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f670ceec-2242-4dea-bcec-e0a898f27707', 1364, N'PAINTING IN ACRYLICS', N'Come and join our friendly class. Encouraging basic lessons are given to beginners and guidance and assistance provided when needed, whatever your skill level.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f1fbf85c-0100-4310-b01c-e16ae5b62161', 1365, N'TRAVEL WITH JOY ', N'Now in our 14th year!  A small group is invited to explore the world through the eyes and camera of a traveller interested in all she sees and learns of the history, culture, customs and life of the people. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'27044e5e-9c44-4183-8fb7-e2d3ab1a2667', 1366, N'SCIENCE AND TECHNOLOGY: GLIMPSES OF OUR PAST, PRESENT AND FUTURE', N'We continue discussions on the history and application of science and technology, with a mix of speakers, using film and with informal talks. Interesting topics: no loss of continuity if you miss sessions. (Wesley Room)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd9e4c1f9-192c-4341-a788-e319e7ec1bc8', 1367, N'BOOK / PLAYREADING CLUB ', N'People are invited to participate with either a book or play reading on alternate weeks. Interested members please phone to discuss further.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd6c56961-d62f-4a3e-af1b-e4b2f0a36f82', 1368, N'MIDDLE EASTERN DANCING', N'The oldest dance form for women explored and expressed to traditional music.  A great way to keep fit and have fun.  If you can walk you can dance. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'62219f78-e98f-4bf7-82c1-e50d33785cfc', 1369, N'FRENCH CONVERSATION ADVANCED**(15)', N'Nous sommes un groupe qui se rencontre chaque mardi pour discuter des sujects divers en francais. Nous lisons aussi des textes varies.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'555b7325-c128-4232-b1b4-e537e295d266', 1370, N'U3A ENDEAVOUR CAMPUS WALKERS - BUSH RAMBLES AND SYDNEY BY FERRY AND FOOT          ', N'Bush and town walks previously walked by walk leader. Items of interest are indicated such as history, fauna, flora, geology etc. Walks are described in our programs to indicate degree of difficulty. Public transport and car pooling are used as appropriate. Member of the AFB. Public risk insurance held. Each year we have a 4-5 day social walking holiday.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f40bae01-dcde-4a5d-bf21-e65e014f30c7', 1371, N'FRIDAY FILMS AT WATERBROOK**(34)', N'Classic films from the silent era to the contemporary will be presented with some analysis and background pertaining to the cast, director and production issues. A full list of movies to be presented will be available at the first performance.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'bc825574-7b3e-4ff3-8e84-e6e9da940689', 1372, N'BOOK OF THE MONTH', N'Discussion group. New members most welcome. Share the experience, expand your understanding and enjoy the process.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'16bf1a7c-57b6-400e-86d5-e768a60d79ca', 1373, N'USA MILITARY BASES IN AUSTRALIA', N'The implications for Australian foreign policy.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1993490f-efb8-4135-ae41-e7857638c05d', 1374, N'MUSICAL MORNINGS (Cronulla)**(8)', N'We will share our love of music with each other using tapes, CDs, records and videos. Come and be enthused and learn a little about composers at the same time.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'90110835-20c3-462e-b7d6-e8aaab9383c5', 1375, N'DISCUSSION GROUP', N'Join this happy group to air your views and discuss a variety of interesting topics selected by the group of members.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'7752a9a6-aa61-4446-a888-e9adf311b200', 1376, N'TWO GREAT PAINTERS', N'The Australian painter Grace Cossington Smith (1892 - 1984) and the German painter Paul Klee (1879 - 1940) were two very different painters. Grace Cossington Smith was a pioneer of modernist painting in Australia. Paul Klee was influenced by cubism and surrealism and was part of the Bauhaus movement. The impact of contemporary world events on their lives and work will be discussed. (2 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f4e722fd-f462-4a1a-a90d-eada06c57798', 1377, N'SOUTH WEST SONGBIRDS (Revesby)**(9)', N'Are you looking for a place to sing besides the shower? You’re in luck. We aim to provide light-hearted group singing with accompaniment. Song requests welcome. Come and make new friends. All songbirds welcome to tweet along.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8fb8b0b3-4536-4107-9674-eb14cc4a4cf7', 1378, N'ENGLISH CONVERSATION', N'Become more confident.  Practice your English with a friendly group of people.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'6be6e231-62c0-460b-8b2e-eb88256f78cd', 1379, N'FRENCH INTERMEDIATE', N'The focus is on conversation, correct pronunciation, grammar and vocabulary enrichment through poetry and song. New members of intermediate standard welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'4f0ac707-7071-46f2-9fdf-ec6d5a41b352', 1380, N'BRIDGE FOR THE LESS COMPETITIVE ', N'Brush up your bridge skills with our informal group in a friendly non-competitive atmosphere. All levels of skill welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'20e67f00-ea25-4ec1-a6a2-edbb77865dbf', 1381, N'FOUR AUSTRALIAN EXPLORERS', N'This course will look at the travels of Matthew Flinders, John Oxley, Charles Sturt and Edward John Eyre. It will consider their experiences and their impressions of the country through which they passed. Each session will deal with the journey of one explorer. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'86298280-c68c-4260-9ec7-f0527bd3e928', 1382, N'ORIGINAL AND CREATIVE THINKING**(15) ', N'We can all manage problems using our experience and education, but can you think ‘outside the box’? Do you know how to tap into your imagination, think creatively and tackle new ventures? A series of 8 workshops designed to challenge conventional thinking and provide opportunities for personal development.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'8dd6f6e1-b05a-426b-ace4-f181c3950f59', 1383, N'WHAT HAPPENS TO SUPERANNUATION WHEN YOU DIE?  Finance/Investment', N'The aim of this lecture is to focus on those issues of most concern to members, so feel free to outline these when booking if you would like to do so. No investment advice can be given.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3a2d8e87-2757-4de6-8b4b-f1f090e9d2f9', 1384, N'THE VIETNAM EXPERIENCE    ', N'Vietnam, its people, culture, beauty and history - this course will whet the appetite for more - through the eyes of one who has been involved for 18 years. (3 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b45b6525-6fff-4c2d-ad75-f27bd7b8d313', 1385, N'THE CITY OF ROME ', N'According to tradition, Rome was founded in fratricide, peopled by outlaws. It became the capital of an Empire covering half of Europe, North Africa and the Middle East.  Ruling for 1200 years it was considered eternal. The illustrated course will look at Rome’s physical transformation, its lifestyle and what remained. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'bd9764a6-f41f-4a6f-99e4-f29e8bab0ac4', 1386, N'THE HISTORY OF SYSTEMS OF GOVERNMENT', N'We will examine democracy, dictatorship and totalitarianism. Particular reference will be made to the Medieval Period, the French Revolution, the development of British parliamentarianism and the governments of Nazi Germany and Soviet Russia. Discussion will be encouraged and the course should offer insights of great interest.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'3301929a-f68b-48c4-bfd7-f35a579eb274', 1387, N'MY FAVOURITE ETHNIC EATING PLACE**(20)    ', N'Share your favourite eating place with fellow culinary adventurers. Each month, a member acts as host. They select a restaurant located in the City of Sydney Local Government Area that is inexpensive, open for lunch and has a person available to talk about the restaurant/cuisine/culture. Members pay for their own meal. (5 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'205232a4-4aaa-4978-98d2-f48a1f172c46', 1388, N'CATHERINE AND POTEMKIN', N'Catherine, Empress of Russia, was a reformer, a moderniser and famously a lusty woman. Potemkin was her ideal partner, in and out of bed.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'02d87664-f0e5-47a7-a116-f6110604453a', 1389, N'YOGA AND RELAXATION', N'The course leader is a Satyananda and International Yoga Teacher’s Association trained teacher. She teaches yoga with an emphasis on relaxation and meditation. Classes include gentle stretches, movements for joints and breathing practices. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'57368b26-564a-4ebb-a62d-f6500f1f7eab', 1390, N'BRUSH UP YOUR SCRABBLE', N'Scrabble enthusiasts will be attracted by the prospect of playing a new miscellany of opponents.  The less experienced will find more opportunities to improve.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'a16f4b7f-7a21-45d8-a874-f6ca5ff40a97', 1391, N'CURRENT AFFAIRS FORUM ', N'A new group will discuss and debate actively, current events of importance in a friendly and lively atmosphere. New members welcome not to say essential. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5be5472c-1622-4518-8654-f70d0a9f23f2', 1392, N'NORTH KOREA TODAY ', N'A series of four sessions led by a regular visitor who has also worked in The Democratic Peoples Republic of Korea.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'b83de0d9-bd71-4fc8-90c4-f822cdf366ed', 1393, N'CLASSICAL MUSIC APPRECIATION', N'Each session will be focused on a particular composer, illustrated with recorded music. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'40f2c1de-8852-43fd-956f-f87b1dead2f0', 1394, N'RECORDER PLAYING ', N'A small group playing tenor, descant, treble and bass recorders and playing music from Renaissance to Bach through to Modern and Jazz. We welcome new players at this level.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'325e04df-b76f-44c3-8054-f94476b1ec22', 1395, N'Exploring Nostalgia in Literature and Customs   ', N'An examination of nostalgia in literature and culture to contemplate the original meaning of the word, from its Greek origins: nostos to return and algos meaning suffering plus an exploration of separation and the rituals, values and beliefs that tie us to our origins. (4 sessions)', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cb1a0467-b705-4054-bb70-f97634228a67', 1396, N'TANG POETRY', N'The Tang Dynasty (613 - 906) is often regarded as the golden era of Chinese poetry. This course will focus on the lives and poetry of five Tang poets: Wang Wei, Li Po, Du Fu, Bai Juyi and Li Shangyin. Group discussion of individual poems will be encouraged. (4 sessions) ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'947e0953-c8f2-4acd-a711-f9967583974a', 1397, N'CURRENT AFFAIRS DISCUSSION and GROUP SOLVING OF CROSSWORDS (Blakehurst)', N'Come along and join us for a relaxing afternoon.  We will look at a pot-pourri of ideas involving voluntary individual member participation with emphasis on communication and fun. Any topic at all may be discussed - no subject is taboo. We will solve one puzzle together before the discussion.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'f6889057-a1c7-482b-981f-f9ca0055a995', 1398, N'PAINTING AND DRAWING IN ANY MEDIUM', N'If you want to paint or draw a masterpiece or just do your own thing, our group could be suitable for you. This is not a teaching class but assistance is given when needed. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
GO
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'd8ee7ce8-ea2a-420c-84a2-f9ee6cf9e85c', 1399, N'PANANIA LIBRARY', N'Corner Tower Street and Anderson Avenue, Panania. Train: East Hills Line (one minute walk from Panania Station). Buses: 923, 924. Parking in adjacent car park accessed from Peffer Street. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'1114ee9e-37b5-49d0-9156-fb50762b3ae7', 1400, N'THE GOLDEN AGE OF CINEMA 2: SUBTITLES AND ONE OFFS**(20) ', N'We will continue last year’s short course on foreign films plus one or two silents and an “oddity”. Background notes are included and a brief discussion held at the end of each program. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'bcf763ea-32e6-47b7-9d61-fc13835c0ca2', 1401, N'IDEAS FOR COOKING FOR ONE**(15) ', N'This course will be limited to 15 so everyone has a chance of sharing ideas.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'0480c723-059e-45d4-8ecf-fd0517fab4ae', 1402, N'CREATIVE WRITING', N'Are you a writer or a would-be writer? There are many different styles of writing and we have space for them all. New members are welcome to join our friendly supportive group.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5778db4e-ef35-407f-a362-fdb9c64946f9', 1403, N'DADA PARRAMATTA', N'Drift and explore yourself and experience the playfulness and exuberance of writing. Everyone welcome.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'22200003-ea39-4e9a-83cf-fe13e9553f77', 1404, N'ART CLASS', N'The class welcomes all, from beginners on. We will be working mainly in acrylic paint. The emphasis will be on fun, relaxation and creativity, encouraging each individual’s creative style. The leader comes from an art background as a practising artist (painter), art teacher and former art therapist. ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cf51567a-28e6-43bd-a6c4-ff670f5c1062', 1405, N'Voices from Heaven, Vivaldi’s Orphans', N'Everyone recognises Vivaldi’s, The Four Seasons. Researchers have recently discovered literally hundreds of additional pieces, many composed for the female orphans at Ospedale della Pieta in 18th Century Venice.  ', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'cc4c6fa5-b794-47f3-a608-ff93da971641', 1406, N'POETRY AND PROSE FOR EVERYONE**(15)', N'Bring your poems or prose to read, or just relax and listen to the reading of established authors, or member’s own work.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
INSERT [dbo].[CourseDescription] ([Id], [CourseNumber], [Title], [Description], [U3AId]) VALUES (N'5f7fa6f7-b903-4860-8594-ffa5c640ca5a', 1407, N'AFTER THE TSUNAMI ', N'When an international disaster of the magnitude of the Japanese earthquake/tsunami occurred the whole world looked on in horror.  How Japan coped with this crisis and its aftermath will be explored, particularly in their response to the disaster and their efforts to overcome the disruption and devastation to their lives.', N'c0c3dd0b-19cb-40c0-a521-3c9e6c9447d5')
